  (278580633, 'Điện thoại Xiaomi Redmi 15 (8GB/128GB) - Hàng chính hãng', '<article class="4ever-article"><ul><li><div>Màn hình IPS LCD 6.9 inch, Full HD+, tần số quét 144Hz</div></li><li><div>Chip Snapdragon 685 tám nhân, hiệu năng ổn định</div></li><li><div>RAM 8GB, bộ nhớ 128GB, đa nhiệm mượt mà</div></li><li><div>Camera chính 50MP, chụp ảnh sắc nét</div></li><li><div>Pin 7000mAh, sạc nhanh 33W tiện lợi</div></li><li><div>Hệ điều hành HyperOS 2 trên nền Android 15</div></li><li><div>Kích thước lớn 171.1 × 82.1 × 8.6 mm, nặng 224g</div></li><li><div>Thiết kế chắc chắn, bền bỉ cho nhu cầu sử dụng lâu dài</div></li><li><div>Trải nghiệm giải trí và chơi game mượt mà</div></li><li><div>Giá trị vượt trội trong phân khúc tầm trung</div></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p class="p1">️ Shop nhận đổi trả trong trường hợp hàng sai mẫu, size, màu do shop gửi. Bên shop chỉ giải quyết khiếu nại khi quý khách có video clip khi mở/nhận