  (278604572, 'Điện thoại Oppo A58 ( 8GB/128GB) - Hàng chính hãng', '<article class="4ever-article"><ul><li><div>Màn hình: IPS LCD 6.72", Full HD+ (1080 x 2400 Pixels)</div></li><li><div>Hệ điều hành: Android 13</div></li><li><div>Camera sau: 50MP, F/1.8 (chính) + 2MP, F/2.4 (xóa phông)</div></li><li><div>Camera trước: 8MP, F/2.0</div></li><li><div>Chipset: Helio G85, tối đa 2.0GHz</div></li><li><div>RAM: 8GB</div></li><li><div>Bộ nhớ trong: 128GB</div></li><li><div>Cổng kết nối/sạc: USB Type-C</div></li><li><div>Dung lượng pin: 5000mAh</div></li><li><div>Bộ sản phẩm gồm: Hộp, thân máy, cáp sạc, cốc sạc,...</div></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p class="p1">️ Shop nhận đổi trả trong trường hợp hàng sai mẫu, size, màu do shop gửi. Bên shop chỉ giải quyết khiếu nại khi quý khách có video clip khi mở/nhận hàng.</p><p class="p1">️ Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành tham gia chương trình khuyến mãi có giá tốt nhất cho khách hàng. Vui lòng chat với shop để được hỗ trợ thêm thông tin.</p><p class="p1">️ Khách hàng có nhu cầu xuất hóa đơn VAT, vui lòng liên hệ với gian hàng trực tiếp qua tin nhắn hoặc chat với Shop khi đơn hàng được giao thành công.</p><p class="p1"> Không nhận đổi trả khi sản phẩm bị hư hại do tác động ngoại lực từ người mua như móp, bể, trầy xước, nổ điện, rớt nước, rách tem bảo hành, không đầy đủ phụ kiện và hộp.</p><p class="p1"> Các sản phẩm bị khóa tài khoản như Gmail, account… Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p class="p1"> Vì lượng hàng hoá nhiều shop không nhận đổi trả trong trường hợp khách không thích, không ưng màu, chất liệu; quý khách vui lòng đọc kĩ mô tả và xem hình ảnh cụ thể; nếu cần hãy chat với shop để được tư vấn.</p></article><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
