  (278726186, 'Điện thoại Xiaomi 15T Pro 5G (12GB/512GB) - Hàng chính hãng', '<article class="4ever-article"><ul><li><div>Màn hình AMOLED 6,83 inch, độ phân giải 1.5K (2772×1280), tần số quét 144Hz mượt mà</div></li><li><div>Chip MediaTek Dimensity 9400+ – hiệu năng cực mạnh, tối ưu cho game và đa nhiệm</div></li><li><div>Camera Leica 3 ống kính: 50MP (chính, OIS) + 50MP tele 5x + 12MP góc siêu rộng</div></li><li><div>Camera selfie 32MP, sắc nét, hỗ trợ AI làm đẹp tự nhiên</div></li><li><div>Pin 5500mAh, sạc nhanh 90W có dây và 50W không dây</div></li><li><div>Hệ điều hành HyperOS (Android 15) – giao diện mượt, nhiều tính năng thông minh</div></li><li><div>Chuẩn kháng nước &amp; bụi IP68, khung kim loại, mặt kính Gorilla Glass 7i bền bỉ</div></li><li><div>Hỗ trợ 5G, Wi-Fi 7, Bluetooth thế hệ mới, đảm bảo tốc độ và ổn định kết nối</div></li><li><div>Thiết kế sang trọng, mỏng nhẹ (~7.96mm, ~210g), cầm nắm thoải mái</div></li><li><div>Bộ sản phẩm gồm: Thân máy, cáp sạc, hướng dẫn sử dụng</div></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p class="p1">️ Shop nhận đổi trả trong trường hợp hàng sai mẫu, size, màu do shop gửi. Bên shop chỉ giải quyết khiếu nại khi quý khách có video clip khi mở/nhận hàng.</p><p class="p1">️ Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành tham gia chương trình khuyến mãi có giá tốt nhất cho khách hàng. Vui lòng chat với shop để được hỗ trợ thêm thông tin.</p><p class="p1">️ Khách hàng có nhu cầu xuất hóa đơn VAT, vui lòng liên hệ với gian hàng trực tiếp qua tin nhắn hoặc chat với Shop khi đơn hàng được giao thành công.</p><p class="p1"> Không nhận đổi trả khi sản phẩm bị hư hại do tác động ngoại lực từ người mua như móp, bể, trầy xước, nổ điện, rớt nước, rách tem bảo hành, không đầy đủ phụ kiện và hộp.</p><p class="p1"> Các sản phẩm bị khóa tài khoản như Gmail, account… Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p class="p1"> Vì lượng hàng hoá nhiều shop không nhận đổi trả trong trường hợp khách không thích, không ưng màu, chất liệu; quý khách vui lòng đọc kĩ mô tả và xem hình ảnh cụ thể; nếu cần hãy chat với shop để được tư vấn.</p></article><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278726248, 'Máy giặt sấy LG Inverter giặt 15 kg - sấy 8 kg F2515RNTG - Hàng Chính Hãng - Mới 100%', '<article class="4ever-article"><ul><li><div>Kiểu máy: Máy giặt sấy</div></li><li><div>Khối lượng giặt: 15kg</div></li><li><div>Khối lượng sấy: 8kg</div></li><li><div>Kiểu động cơ: Truyền động trực tiếp</div></li><li><div>Công nghệ Inverter: Có</div></li><li><div>Chất liệu vỏ máy: Kim loại sơn tĩnh điện</div></li><li><div>Chất liệu lồng giặt: Thép không gỉ</div></li></ul><p>Mức tiêu thụ điện năng</p><ul><li><div>Công suất: 2.000W</div></li><li><div>Điện năng tiêu thụ: 1.88 Wh/kg</div></li><li><div>Nhãn năng lượng: 5 sao</div></li><li><div>Tiết kiệm điện: Inverter</div></li></ul><p>Công nghệ</p><ul><li><div>Công nghệ giặt: Công nghệ AI DD bảo vệ sợi vải, Công nghệ giặt 6 chuyển động thông minh, Giặt hơi nước</div></li><li><div>Công nghệ sấy: Máy sấy ngưng tụ</div></li><li><div>Số lượng chương trình: 12</div></li><li><div>Chương trình giặt: Chu trình tải về, Đồ thể thao, Đồ trẻ sơ sinh, Giặt áo lông, Giặt đồ tinh xảo, Giặt ngừa dị ứng, Giặt nhanh, Giặt vệ sinh, Giũ + vắt, Vải bông, Vệ sinh lồng giặt, Vết bẩn khó giặt</div></li></ul><p>Tính năng và Tiện ích</p><ul><li><div>Hẹn giờ: Có</div></li><li><div>Khóa trẻ em: Có</div></li><li><div>Tiện ích: Điều khiển bằng điện thoại qua App, Điều khiển bằng giọng nói</div></li></ul><p>Thông số lắp đặt</p><ul><li><div>Kích thước: 94cm x 64.5cm x 77cm (Cao x rộng x sâu)</div></li><li><div>Trọng lượng sản phẩm: 81kg</div></li></ul><p>Xuất xứ &amp; Bảo hành</p><ul><li><div>Năm ra mắt: 2024</div></li><li><div>Thương hiệu: LG</div></li><li><div>Xuất xứ thương hiệu: Hàn Quốc</div></li><li><div>Sản xuất tại: Trung Quốc</div></li><li><div>Bảo hành: 24 tháng</div></li></ul><h3>Giặt 15kg, sấy khô 8kg</h3><p>Với khả năng giặt 15kg và sấy 8kg, LG F2515RNTG sẽ là sự lựa chọn phù hợp cho gia đình có khoảng 9 thành viên hoặc dùng cho gia đình bạn ít người nhưng có nhu cầu giặt giũ cao.</p><p> <img src="https://salt.tikicdn.com/cache/w750/ts/product/a5/2f/a5/0624a36145a5da559ba7cb649d4b3e09.jpg" alt="a52fa53d0a560ee544e2cb53cbb6bb4d.jpg" /></p><h3>Về chất liệu</h3><p>Máy giặt sấy LG F2515RNTG sử dụng cửa kính cường lực với màu trong suốt giúp dễ dàng theo dõi quá trình hoạt động của máy. Thanh nâng được làm từ thép không gỉ bền bỉ, hạn chế bám bẩn và dễ dàng vệ sinh.</p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/28/d2/ea/3659eb0b618b0f357a164e7a0dc3d23d.jpg" alt="28d2eab3b7ee1ed1981499b51bd4a3d8.jpg" /></p><p>Lồng giặt làm từ thép không gỉ với kích thước lớn hơn cho phép giặt hoặc sấy một chiếc chăn lớn hoặc bộ ga gối mà không cần chia thành nhiều mẻ, tiết kiệm thời gian và năng lượng.</p><h3>Công nghệ giặt, sấy trên máy</h3><p>Máy giặt sấy LG được áp dụng những công nghệ sau:</p><p>Công nghệ AI DD giúp xác định khối lượng và loại vải của quần áo, từ đó đưa ra chương trình và thời gian giặt phù hợp nhất. Chế độ sấy của máy được trang bị công nghệ AI giúp bảo vệ sợi vải và gia tăng tuổi thọ cho trang phục lên đến 15%.</p><p>Chương trình giặt TurboWash cho phép giặt mạnh mẽ chỉ trong 55 phút nhằm loại bỏ mọi vết bẩn cứng đầu, mang lại cho quần áo sự sạch sẽ như mới. Chu trình này sử dụng công nghệ giặt phun tia vừa giặt sạch, vừa tiết kiệm nước.</p><p>LG F2515RNTG còn sở hữu công nghệ Steam giúp diệt khuẩn lên đến 99,9%, loại bỏ mùi hôi và bụi bẩn trên sợi vải.</p><h3>Động cơ truyền động trực tiếp </h3><p>Máy giặt sấy LG được áp dụng công nghệ Inverter hoạt động ổn định, êm ái và tiết kiệm điện năng tối đa. Động cơ truyền động trực tiếp bằng bộ đảo lưu mang lại khả năng vận hành bền bỉ trong nhiều năm.</p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/11/c0/50/a5ae7d86715e06b2ea0e8f016f8d65fa.jpg" alt="11c0505896628acd33a1cb37d3ac9dbc.jpg" /></p><h3>Tiện ích trên máy giặt sấy</h3><p>Người dùng có thể điều khiển máy giặt sấy từ xa qua qua ứng dụng ThinQ cài trên điện thoại có kết nối Wifi.</p><p>Chỉ cần ra lệnh bằng giọng nói như “Giặt chu trình nào rồi?”, AI sẽ tự động nhận di