  (278733436, '[Chỉ giao Miền Bắc/Nam] TX2725AT9G - Máy giặt lồng đứng LG AI DD Inverter 25kg màu đen TX2725AT9G_Hàng chính hãng', '<p>Máy giặt lồng đứng LG AI DD Inverter 25kg màu đen TX2725AT9G</p><p><strong>Tối ưu trí tuệ nhân tạo</strong></p><p>Giúp giặt sạch dễ dàng</p><p>Trải nghiệm khả năng chăm sóc quần áo vượt trội với trí tuệ nhân tạo AI, tối ưu với từng loại vải</p><p> </p><p><strong>Giải pháp giặt tối ưu</strong></p><p>Được trang bị động cơ truyền động trực tiếp Inverter Direct DriveTM, cùng sáu chu trình giặt, giúp quần áo được chăm sóc kỹ càng.</p><p>Làm sạch mạnh mẽ nhưng nhẹ nhàng chỉ trong 30 phút²)</p><p>Công nghệ LG TurboWash3D mang đến khả năng làm sạch mạnh mẽ nhưng nhẹ nhàng, giúp bạn giặt nhiều hơn trong thời gian ngắn hơn.<br /><br /></p><p><strong>Tự động phân bổ nước giặt/xả</strong></p><p>Sử dụng nhiều lần chỉ trong một lần đổ</p><p>Tự động phân phối đúng lượng chất tẩy rửa và nước xả vải. Thậm chí còn nhận thông báo trên điện thoại thông minh khi đến lúc đổ đầy, giúp giặt giũ nhanh chóng và dễ dàng.</p><p> </p><p><strong>Tầm với dễ dàng, tiện lợi</strong></p><p>Mặt trước của máy giặt có góc nghiêng mang đến khả năng tiếp cận thoải mái, tiện dụng hơn mà không ảnh hưởng đến công suất.</p><p> </p><p><strong>Tối ưu hóa chu trình &amp; tùy chọn</strong></p><p>Chu trình giặt phù hợp với thói quen giặt giũ của bạn</p><p>Bằng cách tự động chọn chu trình thường xuyên dùng, máy giặt có thể giúp bạn tiết kiệm thời gian giặt giũ. Chỉ cần chuyển đổi tùy chọn Chỉnh sửa Danh sách Chu trình.</p><p>Loại bỏ vết bẩn, chất gây dị ứng và vi khuẩn</p><p>Sử dụng hơi nước giúp khử khuẩn và loại bỏ các chất gây dị ứng (³)</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278746741, '[Giao hàng toàn quốc] Máy giặt lồng ngang LG Inverter 10 Kg FX1410N5G - Hàng chính hãng', '<p>Thông số kỹ thuật</p><p>Loại máy: Cửa ngang</p><p>Khối lượng giặt: Từ 9.5 - 10 Kg</p><p>Khối lượng giặt thực tế: 10 kg</p><p><img src="" width="833" height="466" alt="vn-11134208-820l4-mfkxam24hczw1e" /></p><p>Kiểu động cơ: Truyền động trực tiếp</p><p>Tốc độ quay vắt tối đa: 1400 vòng/phút</p><p>Chất liệu lồng giặt: Thép không gỉ</p><p>Chất liệu nắp máy: Kính cường lực</p><p>Loại Inverter: Inverter</p><p><img src="" width="1600" height="1590" alt="vn-11134208-820l4-mfkxam24irkc1e" /></p><p>Kích thước, khối lượng: 600 x 565 x 850 mm</p><p>khối lượng 68 kg</p><p>Công nghệ giặt: TurboWash, Steam</p><p>Bảng điều khiển: Cảm ứng, Tiếng Anh, Tiếng Việt, Có màn hình hiển thị</p><p>Tiện ích: Giặt nước nóng, Inverter tiết kiệm điện, Khóa trẻ em, Kết nối Wifi và điều khiển từ xa bằng điện thoại thông minh</p><p>Chương trình giặt</p><p>Vải bông</p><p>Vải bông +</p><p>Đồ hỗn hợp</p><p>Giặt nhẹ</p><p>Giặt tay/ Đồ len</p><p>Đồ thể thao</p><p>Giặt AI</p><p>Turbowash 39</p><p>Giặt nhanh 14p</p><p>Giặt ngừa dị ứng</p><p><img src="" width="1735" height="510" alt="vn-11134208-820l4-mfkxam24k64sc2" /><img src="" width="1722" height="550" alt="vn-11134208-820l4-mfkxam24lkp8d9" /></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278746764, '[Giao hàng toàn quốc] FX1412N5G - Máy giặt LG AI DD Inverter 12 kg FX1412N5G - Hàng chính hãng', '<p>Đặc điểm nổi bật</p><p>Khối lượng 12 kg phù hợp cho gia đình đông người, từ 7 thành viên trở lên.</p><p>Công nghệ Turbowash giúp rút ngắn thời gian giặt nhưng vẫn quần áo sạch sẽ.</p><p>Công nghệ AI DD chăm sóc sợi vải tốt hơn, nâng cao hiệu suất giặt.</p><p>Động cơ Inverter tiết kiệm điện và vận hành bền bỉ theo thời gian.</p><p>Công nghệ giặt hơi nước Steam loại bỏ các tác nhân gây dị ứng, quần áo luôn sạch.</p><p>Kết nối Wi-Fi điều khiển từ xa qua ứng dụng LG ThinQ, tùy chỉnh và điều khiển máy nhanh chóng.</p><p>Tổng quan</p><p>Loại máy giặt: Cửa trước</p><p>Lồng giặt: Lồng ngang</p><p>Khối lượng giặt: 12 Kg</p><p>Kiểu động cơ: Truyền động trực tiếp</p><p>Tốc độ quay vắt tối đa:1400 vòng/phút</p><p>Chất liệu lồng giặt: Thép không gỉ</p><p>Chất liệu vỏ máy: Kim loại sơn tĩnh điện</p><p>Chất liệu cửa máy: Kính cường lực</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278746811, '[Giao hàng toàn quốc] Máy giặt LG FX1412S3K Inverter 12 kg - Hàng chính hãng', '<p>Thiết kế lồng đứng với khối lượng giặt lớn 12 kg phù hợp gia đình trên 5 thành viên.</p><p>Công nghệ TurboWash hỗ trợ giặt nhanh, tiết kiệm thời gian và công sức giặt giũ. </p><p>Giặt hơi nước Steam giảm nhăn, diệt khuẩn và các tác nhân gây dị ứng.</p><p>Công nghệ Inverter giúp máy vận hành ổn định, tiết kiệm điện.</p><p>Điều khiển từ xa thông qua ứng dụng LG ThinQ thuận tiện.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278750390, 'Android Tivi Box - Ram 2G - Android TV 10 - Dual Wifi - Bluetooth - Netflix - Remote Tìm Kiếm Bằng Giọng Nói - Hàng Nhập Khẩu', '<p>**Hỗ trợ tư vấn sản phẩm</p><p>** Ưu điểm Q1 ATV</p><p>1. Hệ điều hành nâng cấp lên Android TV</p><p>2. Sử dụng con chip CPU Allwin H313 cực mạnh</p><p>3. Android Tivi Box Q1 2023 chỉ có 1 phiên bản Rom ATV tích hợp Google Asistant có chứng chỉ Google</p><p>- Rom gốc là sử dụng giao diện thuần android do chính nhà sản xuất phát triển tức là rom giao diện ban đầu được cài trực tiếp vào sản phẩm . Ưu điểm là dễ sử dụng , phù hợp với người già và trẻ nhỏ</p><p>• Sản phẩm hỗ trợ đầy đủ các cổng kết nối như HDM, AV, USB, hay thậm chú là khe thẻ nhớ TF có khả năng nâng cấp bộ nhớ cho Q1</p><p>• Cổng mang Lan cho phép bạn cắm trực tiếp dây mạng trong trường hợp nhà bạn không có wiif hay mạng yếu</p><p>• Độ phân giải tối đa lên đến 4k cho phép Q1 trở thành ông vua trong phân khúc giá rẻ</p><p>- Cấu hình chi tiết:</p><p>• Ram 2GB - Rom 8GB</p><p>• Hệ điều hành Android TV 10</p><p>• GPU: ARM Mali-450 (5 Cores)</p><p>• CPU: Allwin H313 64 Bit mới nhất 2024</p><p>• Giao diện Android Tivi - Sử dụng Tiếng Việt</p><p>• Độ phân giải 4k video - Hỗ trợ nhiều cổng kết nối HDMI, AV, USB, Khe cắm thẻ nhớ TF</p><p>• Dual Wifi 2.4Ghz - 5.0 Ghz</p><p>• Hỗ trợ remote tìm kiếm bằng giọng nói</p><p>• Cổng âm thanh 3.5 hỗ trợ xuất cả âm thanh và hình ảnh.</p><p>- Đơn vị sản xuất và lắp ráp: Jangjun Technology Co., Ltd</p><p>- Địa chỉ : 370 Xiangshan Avenue, Luotian Community, Yanluo Street, Baoan District, Shenzhen</p><p>- Xuất xứ : Trung Quốc</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278751985, 'Hộp mực P225 CT202330 TECH dùng cho máy in Xerox P225 M255 P265 in được 2.6K - Hàng Nhập Khẩu', '<p class="QN2lPu">Thông số hộp mực P225 TECH</p><ul><li class="QN2lPu">Mã mực: CT202330</li><li class="QN2lPu">Loại mực: In laser trắng đen</li><li class="QN2lPu">Dung lượng: 2.600 trang độ phủ 5%</li><li class="QN2lPu">Mực in dùng cho máy Fuji Xerox P225 /M225/ M225DW/ P265/ M265</li><li class="QN2lPu">Xuất xứ: Trung Quốc</li></ul><p class="QN2lPu">Hộp mực chất lượng đảm bảo, bản in đậm đẹp, Với giá thành thấp, Các bạn chỉ việc mua về gắn vào sử dụng, không phải nạp mực, bụi bẩn, Thay vì nạp mực giá cũng đã 130k...</p><p class="QN2lPu">Năng suất trang in lớn lên đến 2600 trang giúp bạn tiết kiệm tối đa chi phí sử dụng mực.</p><p class="QN2lPu"><img src="https://salt.tikicdn.com/ts/tmp/e8/67/84/6ef05841bda27d4adea6db2bdb7311fe.jpeg" alt="" width="750" height="750" /></p><p class="QN2lPu">Shop Cam kết</p><p class="QN2lPu">Về sản phẩm: Shop cam kết cả về CHẤT LƯỢNG cũng như HÌNH DÁNG ( đúng với những gì được nêu trong phần mô tả sản phẩm).</p><p class="QN2lPu">Về giá cả : Shop nhập với số lượng nhiều nên chi phí sẽ là TỐT NHẤT nhé.</p><p class="QN2lPu">Về dịch vụ: Shop sẽ cố gắng trả lời hết những thắc mắc xoay quanh sản phẩm nhé.</p><p class="QN2lPu">Thời gian chuẩn bị hàng: Hàng có sẵn, thời gian chuẩn bị tối NHANH nhất.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278752063, 'Cụm Drum CT351055 TECH dùng cho máy in Xerox P225 M225 P265 M265 (Drum Unit) 12K - Hàng Nhập khẩu', '<p>Mã sản phẩm: CT351055.<br />Thương hiệu: TECH (nhà sản xuất cụm drum tương thích).<br />Tuổi thọ: Khoảng 12.000 trang in với độ phủ mực 5%.<br />Các dòng máy in tương thích:<br />Xerox Docuprint P225d, P225db, P265dw.<br />Xerox Docuprint M225dw, M225z, M265z.</p><p><img src="https://salt.tikicdn.com/ts/tmp/37/83/0b/af2ff47b83960e865524e8f7b0773eb5.jpg" alt="" width="750" height="750" /></p><p>Đặc điểm và ưu điểm<br />Tiết kiệm chi phí: Là sản phẩm tương thích, có giá thành thấp hơn nhiều so với cụm drum hãng, giúp giảm chi phí in ấn.<br />Dễ dàng thay thế: Được thiết kế để dễ dàng lắp đặt vào các dòng máy in tương thích, người dùng có thể tự thay tại nhà mà không cần kỹ thuật viên.<br />Bảo vệ máy in: Nếu là sản phẩm chất lượng tốt, cụm drum tương thích sẽ không gây hại cho máy in. <br />Lưu ý<br />Phân biệt drum và hộp mực: Cụm drum là một bộ phận tách rời với hộp mực (toner cartridge) trên một số dòng máy Xerox. Khi cần thay, người dùng chỉ cần tháo cụm drum cũ ra và gắn hộp mực cũ vào cụm drum mới rồi lắp vào máy.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278755917, 'Bộ Chia Mạng Switch Để Bàn TP-Link LS1005 5 Cổng 10/100Mbps - Hàng Chính Hãng', '<h4>Bộ Chia Mạng Switch Để Bàn TP-Link LS1005 5 Cổng 10/100Mbps</h4><ul><li>5 Cổng RJ45 10/100Mbps tự động đàm phán, hỗ trợ tự động-MDI / MDIX</li><li>Công nghệ Green Ethernet tiết kiệm điện năng tiêu thụ</li><li>Kiểm soát luồng IEEE 802.3X cung cấp truyền dữ liệu đáng tin cậy</li><li>Vỏ nhựa và thiết kế để bàn</li><li>Cắm và chạy, không cần cấu hình</li><li>Thiết kế không quạt đảm bảo hoạt động yên tĩnh.</li></ul><p><img title="" src="https://salt.tikicdn.com/ts/tmp/c2/f0/16/d255236272f18220da5226333f1cec8f.png" alt="" width="1774" height="842" /></p><p> </p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278756915, 'Cụm trống từ DRB022 B027 TECH dùng cho máy in Brother HL B2000 B2080dw (DRB022/B027) 12K - Hàng Nhập Khẩu', '<p>Thông số kỹ thuật chính<br />Mã sản phẩm: DR-B022 hoặc DR B027.<br />Loại mực: In laser trắng đen.<br />Tuổi thọ: Khoảng 12.000 trang (với độ phủ mực 5%) đối với sản phẩm chính hãng hoặc tương đương. Một số nhà cung cấp có thể quảng cáo tuổi thọ cao hơn.<br />Công nghệ: Hoạt động dựa trên công nghệ in laser, trong đó trống (drum) được tích điện và tạo ra hình ảnh tĩnh điện, sau đó hút mực từ hộp mực và chuyển lên giấy.<br />Tương thích với các dòng máy in Brother: <br />HL-B2000D, HL-B2080DW. DCP-B7535DW. MFC-B7715DW. (DRB022)<br />Và một số máy khác như HL-B2100D, HL-B2180DW, DCP-B7640DW, MFC-B7810DW. (B027)</p><p><img src="https://salt.tikicdn.com/ts/tmp/64/a4/11/131a57fffcc2ac503138fd4a09e41c46.jpg" alt="" width="700" height="700" /></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278756961, 'Hộp mực TN B022 TN B027 TECH dùng cho máy in Brother HL B2000/B2080 (TNB022/B027) 2.6K - Hàng Nhập Khẩu', '<p>Hộp mực TN B022 B027 TECH là tên gọi của một loại hộp mực tương thích, được sản xuất bởi một hãng thứ ba (TECH), dùng để thay thế cho hộp mực chính hãng Brother TN-B022. <br />Thông tin chi tiết:<br />Mã hộp mực tương thích: TECH-Brother TN-B022.<br />Mã hộp mực gốc: TN-B022.<br />Loại mực: Mực in laser màu đen.<br />Dung lượng: Thường là 2.600 trang với độ phủ 5%<br />Ưu điểm: Giá thành thường rẻ hơn đáng kể so với hộp mực gốc.<br />Máy in tương thích:<br />Hộp mực TECH B022 BO07 được sử dụng cho các dòng máy in laser đen trắng của Brother, bao gồm:<br />Brother HL-B2000D<br />Brother HL-B2080DW<br />Brother DCP-B7535DW<br />Brother MFC-B7715DW <br />Brother HL-B2100D, HL-B2180DW, DCP-B7620DW, DCP-B7640DW, MFC-B7810DW</p><p><img src="https://salt.tikicdn.com/ts/tmp/3d/d9/41/04e7e44e544971316dd57990e481915f.jpg" alt="" width="750" height="750" /></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278756988, 'Hộp mực CRG071 TECH NO CHIP dùng cho máy in Canon LBP 121dn/ 122dw/ MF272dw 1.2K - Hàng Nhập Khẩu', '<p>Các thông tin về hộp mực 071</p><ul><li>Loại mực: Mực in laser đen trắng.</li><li>Dung lượng: Tiêu chuẩn (071): Khoảng 1.200 trang với độ phủ 5%.</li><li>Dùng cho các dòng máy in laser Canon i-SENSYS như:<br />Canon LBP 120, 121dn, 122dw.<br />Canon MF270, MF271dn, MF272dw, MF274dn, MF275dw.</li><li>Thương hiệu: TECH</li><li><strong>Ghi chú: Hộp mực in chưa gồm chíp</strong></li></ul><p>Đặc điểm hộp mực tương thích không chíp vẫn hoạt động đối với một số máy không cho in thì có thể gắn chip từ hộp mực cũ vào để in.<br />Giá cả phải chăng, Có thể nạp lại sau khi hết mực.</p><p><img src="https://salt.tikicdn.com/ts/tmp/bd/45/07/a1f02ca5d7db443468bfcf567aed7379.jpg" alt="" width="750" height="750" /></p><p> </p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
