  (278757493, 'Hộp mực W1360A 136A CÓ CHIP TECH dùng cho máy in HP M211d M211dw M236dw - Hàng Nhập Khẩu', '<p>Thông tin cơ bản<br />Mã sản phẩm: 136A (hoặc W1360A W1360X).<br />Loại mực: Laser trắng đen.<br />Dung lượng: Khoảng 1.150 trang với độ phủ 5%.<br />Hộp mực đã gồm chíp<br />Dùng cho máy in: <br />HP LaserJet M211d<br />HP LaserJet M211dw<br />HP LaserJet M236dw<br />HP LaserJet M236sdw<br />Thương hiệu TECH<br />Hộp mực 136A Tech là sản phẩm mực tương thích, không phải mực chính hãng. Tech là tên thương hiệu sản xuất hộp mực và linh kiện máy in tương thích, mang lại giải pháp thay thế với chi phí thấp hơn cho người dùng</p><p><img src="https://salt.tikicdn.com/ts/tmp/49/eb/07/116351d9499b5ae5c5e0d83861715bed.jpg" alt="" width="750" height="750" /></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
