  (278776793, 'Điện thoại Realme Note 70 (4GB/128GB) - Hàng chính hãng', '<article class="4ever-article"><ul><li><div>Màn hình IPS LCD 6.74 inch độ phân giải HD+ 720×1600, tần số quét 90Hz hiển thị mượt mà</div></li><li><div>Vi xử lý Unisoc T7250 (12nm, 8 nhân) đáp ứng tốt nhu cầu sử dụng hằng ngày</div></li><li><div>RAM 4GB (hỗ trợ mở rộng Dynamic RAM Expansion) cùng bộ nhớ 128GB lưu trữ thoải mái</div></li><li><div>Pin dung lượng 6300mAh kèm sạc nhanh 15W cho thời gian sử dụng lâu dài</div></li><li><div>Camera sau 13MP và camera trước 5MP đủ dùng cho chụp ảnh, học và họp trực tuyến</div></li><li><div>Thiết kế mỏng nhẹ 167.2 × 76.6 × 7.94 mm, trọng lượng khoảng 201g dễ cầm nắm</div></li><li><div>Màn hình đạt độ sáng tối đa khoảng 563 nit, hiển thị rõ ngay cả khi ngoài trời</div></li><li><div>Hỗ trợ kết nối 4G LTE, Wi-Fi băng tần kép và Bluetooth 5.2</div></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p class="p1">️ Shop nhận đổi trả trong trường hợp hàng sai mẫu, size, màu do shop gửi. Bên shop chỉ giải quyết khiếu nại khi quý khách có video clip khi mở/nhận hàng.</p><p class="p1">️ Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành tham gia chương trình khuyến mãi có giá tốt nhất cho khách hàng. Vui lòng chat với shop để được hỗ trợ thêm thông tin.</p><p class="p1">️ Khách hàng có nhu cầu xuất hóa đơn VAT, vui lòng liên hệ với gian hàng trực tiếp qua tin nhắn hoặc chat với Shop khi đơn hàng được giao thành công.</p><p class="p1"> Không nhận đổi trả khi sản phẩm bị hư hại do tác động ngoại lực từ người mua như móp, bể, trầy xước, nổ điện, rớt nước, rách tem bảo hành, không đầy đủ phụ kiện và hộp.</p><p class="p1"> Các sản phẩm bị khóa tài khoản như Gmail, account… Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p class="p1"> Vì lượng hàng hoá nhiều shop không nhận đổi trả trong trường hợp khách không thích, không ưng màu, chất liệu; quý khách vui lòng đọc kĩ mô tả và xem hình ảnh cụ thể; nếu cần hãy chat với shop để được tư vấn.</p></article><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
