  (278778124, 'Thiết Bị Lưu Trữ QNAP TS-673A-8G - Hàng Chính Hãng', '<div class="spec-header"><h4>TS-673A-8G</h4><div class="button-download-spec__icon"><div> </div></div></div><div class="section-specs-table"><table class="tab-sty2 hardware-spec-table"><tbody><tr><td width="35%">CPU</td><td class="sp-tb">AMD Ryzen Embedded V1500B 4-core/8-thread 2.2 GHz processor</td></tr><tr><td width="35%">CPU Architecture</td><td class="sp-tb">64-bit x86</td></tr><tr><td width="35%">Graphic Processors</td><td class="sp-tb">Optional via a PCIe adapter</td></tr><tr><td width="35%">Floating Point Unit</td><td class="sp-tb"> </td></tr><tr><td width="35%">Encryption Engine</td><td class="sp-tb"> (AES-NI)</td></tr><tr><td width="35%">Hardware-accelerated Transcoding</td><td class="sp-tb">Optional via a PCIe adapter</td></tr><tr><td width="35%">System Memory</td><td class="sp-tb">8 GB SODIMM DDR4 (1 x 8 GB)</td></tr><tr><td width="35%">Maximum Memory</td><td class="sp-tb">64 GB (2 x 32 GB)</td></tr><tr><td width="35%">Memory Slot</td><td class="sp-tb">2 x SODIMM DDR4<br />Support ECC memory<div class="tb-note">For dual-DIMM configurations, you must use a pair of identical DDR4 modules.</div></td></tr><tr><td width="35%">Flash Memory</td><td class="sp-tb">5GB (Dual boot OS protection)</td></tr><tr><td width="35%">Drive Bay</td><td class="sp-tb">6 x 3.5-inch SATA 6Gb/s, 3Gb/s</td></tr><tr><td width="35%">Drive Compatibility</td><td class="sp-tb">3.5-inch SATA hard disk drives<br />2.5-inch SATA solid state drives</td></tr><tr><td width="35%">Hot-swappable</td><td class="sp-tb"><div class="tb-note">The following are not hot-swappable: M.2 SSDs, SSD cache drives, SSDs using PCIe expansion slots.</div></td></tr><tr><td width="35%">M.2 Slot</td><td class="sp-tb">2 x M.2 2280 PCIe Gen3 x1 slots<div class="tb-note">The M.2 SSD is not included as standard.<br />M.2 SSD operations can easily generate excessive heat. It is recommended to install a heatsink (from QNAP or a third-party provider) on the M.2 SSD.</div></td></tr><tr><td width="35%">SSD Cache Acceleration Support</td><td class="sp-tb"> </td></tr><tr><td width="35%">GPU pass-through</td><td class="sp-tb"> </td></tr><tr><td width="35%">2.5 Gigabit Ethernet Port (2.5G/1G/100M)</td><td class="sp-tb">2(2.5G/1G/100M)</td></tr><tr><td width="35%">5 Gigabit Ethernet Port (5G/2.5G/1G/100M)</td><td class="sp-tb">Optional via a PCIe adapter</td></tr><tr><td width="35%">10 Gigabit Ethernet Port</td><td class="sp-tb">Optional via a PCIe adapter</td></tr><tr><td width="35%">Wake on LAN (WOL)</td><td class="sp-tb"> </td></tr><tr><td width="35%">Jumbo Frame</td><td class="sp-tb"> </td></tr><tr><td width="35%">PCIe Slot</td><td class="sp-tb">2<br />Slot 1: PCIe Gen 3 x4<br />Slot 2: PCIe Gen 3 x4<div class="tb-note">Card dimensions for PCIe slot 1~Slot 2：200 x 111.15 x 18.76 mm / 7.87 x 4.38 x 0.74 inches.<br />Wider cards can be installed if the next PCIe slot will not be used.</div></td></tr><tr><td width="35%">USB 3.2 Gen 2 (10Gbps) Port</td><td class="sp-tb">3 x Type-A USB 3.2 Gen 2 10Gbps<br />1 x Type-C USB 3.2 Gen 1 5Gbps</td></tr><tr><td width="35%">HDMI Output</td><td class="sp-tb">Optional via a PCIe adapter</td></tr><tr><td width="35%">Form Factor</td><td class="sp-tb">Tower</td></tr><tr><td width="35%">LED Indicators</td><td class="sp-tb">Status/Power, USB, LAN, Drive 1-6, M.2 SSD 1-2</td></tr><tr><td width="35%">Buttons</td><td class="sp-tb">Power, Reset, USB Auto Copy</td></tr><tr><td width="35%">Dimensions (HxWxD)</td><td class="sp-tb">180.2 × 264.3 × 279.6 mm<div class="tb-note">Dimensions do not include foot pad (foot pad may be up to 30mm / 1.18 inches high depending on model)</div></td></tr><tr><td width="35%">Weight (Net)</td><td class="sp-tb">6.4 kg</td></tr><tr><td width="35%">Weight (Gross)</td><td class="sp-tb">7.3 kg</td></tr><tr><td width="35%">Operating Temperature</td><td class="sp-tb">0 - 40 °C (32°F - 104°F)</td></tr><tr><td width="35%">Storage Temperature</td><td class="sp-tb">-20 - 70°C (-4°F - 158°F)</td></tr><tr><td width="35%">Relative Humidity</td><td class="sp-tb">5-95% RH non-condensing, wet bulb: 27˚C (80.6˚F)</td></tr><tr><td width="35%">Power Supply Unit</td><td class="sp-tb">250W, 100-240V AC, 50-60Hz, 3.5A</td></tr><tr><td width="35%">Power Consumption: Disk Standby Mode</td><td class="sp-tb">21.891 W</td></tr><tr><td width="35%">Power Consumption: Operating Mode, Typical</td><td class="sp-tb">45.898 W<div class="tb-note">Tested with drives fully populated.</div></td></tr><tr><td width="35%">Fan</td><td class="sp-tb">System fan: 2 x 92mm<br />CPU fan: 1 x 60mm</td></tr><tr><td width="35%">System Warning</td><td class="sp-tb">Buzzer</td></tr><tr><td width="35%">Kensington Security Slot</td><td class="sp-tb"> </td></tr><tr><td width="35%">Standard Warranty</td><td class="sp-tb">3</td></tr><tr><td width="35%">Max. Number of Concurrent Connections (CIFS) - with Max. Memory</td><td class="sp-tb">2000</td></tr></tbody></table></div><div><div class="gtx-trans-icon"> </div></div><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278780989, 'Điện thoại Oppo A6 Pro (8GB/256GB) - Hàng chính hãng', '<article class="4ever-article"><ul><li><div>Màn hình AMOLED 6.57 inch Full HD+ tần số quét 120Hz hiển thị mượt, màu sắc sống động</div></li><li><div>Bộ nhớ RAM 8GB + ROM 256GB, lưu trữ thoải mái và xử lý đa nhiệm ổn định</div></li><li><div>Camera sau 50MP + 2MP, camera trước 16MP cho ảnh rõ nét và selfie tự nhiên</div></li><li><div>Chip xử lý 4nm mạnh mẽ, tối ưu hiệu suất và tiết kiệm pin</div></li><li><div>Thiết kế mỏng nhẹ, bo cong mềm mại, cảm giác cầm nắm dễ chịu</div></li><li><div>Độ sáng cao 1400 nits, hiển thị rõ ràng ngay cả dưới ánh nắng</div></li><li><div>Pin dung lượng lớn, sạc nhanh tiện lợi đáp ứng trọn ngày dài</div></li><li><div>Chuẩn kháng nước và bụi giúp máy bền bỉ hơn trong điều kiện sử dụng hằng ngày</div></li></ul><p> </p><p class="p1">LƯU Ý KHI MUA HÀNG</p><p class="p1">Cảm ơn quý khách đã quan tâm đến sản phẩm bên shop, quý khách vui lòng dành ít thời gian đọc kĩ các thông tin sau:</p><p class="p1">️ Sản phẩm được bao test 7 ngày kể từ ngày nhận được sản phẩm và sẽ được đổi máy mới cùng model hoặc giá trị tương đương sau khi được thẩm định lỗi kĩ thuật.</p><p class="p1">️ Sản phẩm lỗi kĩ thuật được xác nhận bởi trung tâm bảo hành ủy quyền chính hãng (bằng văn bản); khách hàng có thể gửi lại shop để xác nhận lỗi hoặc tới trung tâm bảo hành ủy quyền để thẩm định lỗi.</p><p class="p1">️ Shop hỗ trợ phí vận chuyển trong vòng 7 ngày (kể từ ngày mình nhận hàng), sau 7 ngày shop chỉ hỗ trợ khách bảo hành (phí vận chuyển khách trả)</p><p class="p1">️ Sau 7 ngày bao test, sản phẩm vẫn nhận chính sách bảo hành theo quy định của nhà sản xuất (khách chịu phí vận chuyển tới shop bảo hành hộ hoặc tự đến trung tâm bảo hành).</p><p class="p1">️ Sản phẩm đổi trả phải còn nguyên hộp trùng imei, phụ kiện kèm theo máy không trầy xước, cháy nổ, đứt dây (nếu trầy xước shop không đổi phụ kiện mới)</p><p class="p1">️ Shop nhận đổi trả trong trường hợp hàng sai mẫu, size, màu do shop gửi. Bên shop chỉ giải quyết khiếu nại khi quý khách có video clip khi mở/nhận hàng.</p><p class="p1">️ Trong một số trường hợp sản phẩm đã được kích hoạt bảo hành tham gia chương trình khuyến mãi có giá tốt nhất cho khách hàng. Vui lòng chat với shop để được hỗ trợ thêm thông tin.</p><p class="p1">️ Khách hàng có nhu cầu xuất hóa đơn VAT, vui lòng liên hệ với gian hàng trực tiếp qua tin nhắn hoặc chat với Shop khi đơn hàng được giao thành công.</p><p class="p1"> Không nhận đổi trả khi sản phẩm bị hư hại do tác động ngoại lực từ người mua như móp, bể, trầy xước, nổ điện, rớt nước, rách tem bảo hành, không đầy đủ phụ kiện và hộp.</p><p class="p1"> Các sản phẩm bị khóa tài khoản như Gmail, account… Khách tự chịu phí mở khóa nếu không nhớ mật khẩu.</p><p class="p1"> Vì lượng hàng hoá nhiều shop không nhận đổi trả trong trường hợp khách không thích, không ưng màu, chất liệu; quý khách vui lòng đọc kĩ mô tả và xem hình ảnh cụ thể; nếu cần hãy chat với shop để được tư vấn.</p></article><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278781417, '[Chỉ giao Miền Trung/Nam] Tủ lạnh LG ngăn đá dưới màu đen 363L LBB33BLM - Hàng chính hãng', '<p>Tủ lạnh LG ngăn đá dưới màu đen 335L LBB33BLM</p><p>### ️ THÔNG SỐ KỸ THUẬT CƠ BẢN</p><p>- Loại sản phẩm: Ngăn đông trên</p><p> </p><p>###  DUNG TÍCH</p><p>- Dung tích sử dụng (L): 315</p><p>- Dung tích tổng (L): 340</p><p>- Dung tích ngăn đông (L): 236</p><p> </p><p>###  ĐIỀU KHIỂN &amp; MÀN HÌNH</p><p>- Cảnh báo cửa: Có</p><p>- Đóng nhanh: Không</p><p>- Điều khiển thủ công: Nút vặn tròn</p><p> </p><p>###  KÍCH THƯỚC &amp; TRỌNG LƯỢNG</p><p>- Trọng lượng đóng gói (kg): 63</p><p>- Trọng lượng sản phẩm (kg): 57</p><p>- Kích thước sản phẩm (RxCxS, mm): 600 × 1640 × 710</p><p> </p><p>### ️ TÍNH NĂNG</p><p>- Làm mát cửa +: Có</p><p>- Door-in-Door: Không</p><p>- Linear Cooling: Có</p><p>- Chất làm lạnh: R600a</p><p> </p><p>###  HỆ THỐNG ĐÁ &amp; NƯỚC</p><p>- Máy làm đá thủ công: 1 Tay quay 2 Khay</p><p>- Vòi lấy nước: Không</p><p>- Máy làm đá tự động: Không</p><p> </p><p>###  VẬT LIỆU &amp; HOÀN THIỆN</p><p>- Cửa (Vật liệu): PCM</p><p>- Hoàn thiện (Cửa): Màu đen lì</p><p>- Kiểu tay cầm: Túi ngang (Chrome)</p><p>- Vật liệu tay cầm: Nhựa</p><p> </p><p>###  HIỆU SUẤT</p><p>- Máy nén: Máy nén biến tần thông minh (BLDC)</p><p>- Điện năng tiêu thụ (kWh/năm): 380</p><p>- Nhãn năng lượng: 5 sao</p><p> </p><p>### ️ KHOANG CHẤT LÀM LẠNH</p><p>- Giờ cửa Trong suốt: 3</p><p>- Đèn tủ lạnh: LED phía trên</p><p>- Giá kính cường lực: 2</p><p>- Hộp đựng rau: Có (1)</p><p>- Hygiene Fresh+: Không</p><p> </p><p>###  CÔNG NGHỆ THÔNG MINH</p><p>- Chẩn đoán thông minh: Có</p><p>- ThinQ (Wi-Fi): Không</p><p> </p><p>###  KHOANG TỦ ĐÔNG</p><p>- Giờ cửa Trong suốt: 2</p><p>- Giá kính cường lực: 1</p><p>Không gian tủ lạnh rộng rãi</p><p>Mở rộng không gian lưu trữ của tủ lạnh, gia tăng thể tích</p><p>Ngăn đá dưới lớn hơn giúp tăng tổng thể tích và tăng khả năng lưu trữ của tủ lạnh.</p><p> </p><p>LinearCooling</p><p>Bảo quản thực phẩm tươi lâu hơn</p><p>LinearCooling làm giảm biến động nhiệt độ, giữ lại hương vị tươi ngon và giữ thực phẩm tươi lên đến 7 ngày1).</p><p> </p><p>DoorCooling⁺</p><p>Làm lạnh nhanh hơn 38 phút</p><p>Đồ uống lạnh nhanh hơn và thực phẩm tươi lâu nhờ công nghệ làm lạnh từ cửa DoorCooling⁺</p><p> </p><p>Smart Inverter Compressor</p><p>Thực phẩm tươi mà vẫn tiết kiệm điện</p><p>LG Smart Inverter Compressor tiết kiệm năng lượng bằng cách điều chỉnh tốc độ động cơ.</p><p> </p><p>Thời gian vệ sinh</p><p>Vệ sinh tủ lạnh không cần nhắc nhở hay rút phích cắm</p><p>Dễ dàng vệ sinh mà không cần phải rút phích nguồn hoặc tắt chuông báo tủ lạnh.Thời gian vệ sinh</p><p>Vệ sinh tủ lạnh không cần nhắc nhở hay rút phích cắm</p><p>Dễ dàng vệ sinh mà không cần phải rút phích nguồn hoặc tắt chuông báo tủ lạnh.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
