dth:216.865px;">Power Supply Unit</td><td class="sp-tb" style="height:18px;width:404.469px;">External, 120 W, AC 100 to 240 V</td></tr><tr style="height:36px;"><td style="height:36px;width:216.865px;">Power Consumption: Disk Standby Mode</td><td class="sp-tb" style="height:36px;width:404.469px;">41.2 W</td></tr><tr style="height:36px;"><td style="height:36px;width:216.865px;">Power Consumption: Operating Mode, Typical</td><td class="sp-tb" style="height:36px;width:404.469px;">55.41 W<div class="tb-note">Tested with drives fully populated.</div></td></tr><tr style="height:18px;"><td style="height:18px;width:216.865px;">Fan</td><td class="sp-tb" style="height:18px;width:404.469px;">1 x 140mm, 12VDC</td></tr><tr style="height:18px;"><td style="height:18px;width:216.865px;">System Warning</td><td class="sp-tb" style="height:18px;width:404.469px;">Buzzer</td></tr><tr style="height:18px;"><td style="height:18px;width:216.865px;">Kensington Security Slot</td><td class="sp-tb" style="height:18px;width:404.469px;"> </td></tr><tr style="height:18px;"><td style="height:18px;width:216.865px;">Standard Warranty</td><td class="sp-tb" style="height:18px;width:404.469px;">3</td></tr><tr style="height:54px;"><td style="height:54px;width:216.865px;">Max. Number of Concurrent Connections (CIFS) - with Max. Memory</td><td class="sp-tb" style="height:54px;width:404.469px;">2000</td></tr></tbody></table></div><div><div class="gtx-trans-icon"> </div></div><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278786584, 'Tủ lạnh Panasonic Inverter 326 lít NR-TL351VGMV - Hàng Chính Hãng ', '<p><img title="" src="https://salt.tikicdn.com/ts/tmp/72/36/b0/c11147632f826d615ed1b2b2f23b6c0e.png" alt="" width="635" height="587" /></p><p> </p><ul><li>Công nghệ Blue Ag+: Diệt khuẩn hiệu quả, bảo vệ sức khỏe với khả năng tiêu diệt vi khuẩn E.coli và tụ cầu vàng.</li><li>Ngăn trữ đông Ag Hygiene Zone: Hạn chế mùi hôi và bảo quản thực phẩm tươi sống tốt hơn.</li><li>Ngăn Extra Cool Zone: Ướp lạnh đồ uống nhanh chóng và giữ thực phẩm an toàn nhờ nắp kháng khuẩn.</li><li>Công nghệ tiết kiệm điện Econavi: Tự động tối ưu hóa công suất làm lạnh, giảm điện năng tiêu thụ.</li><li>Công nghệ Multi Control: Điều chỉnh nhiệt độ chính xác ở các ngăn tủ giúp tiết kiệm điện.</li><li>Công nghệ làm lạnh Panorama: Làm lạnh đồng đều mọi ngóc ngách trong tủ.</li><li>Thiết kế mặt gương tinh tế: Tạo vẻ sang trọng, dễ dàng lau chùi.</li><li>Ngăn rau củ rộng rãi: Lưu trữ thực phẩm lớn, giữ độ tươi lâu.</li><li>Làm đá siêu tốc: Tạo đá nhanh hơn 30%, tiện lợi cho đồ uống.</li><li>Dung tích 326 lít: Phù hợp cho gia đình từ 3 - 4 người.</li></ul><h3>Công nghệ khử khuẩn Blue Ag+ bảo vệ sức khỏe cho người dùng </h3><p>Một trong những tính năng nổi bật của  NR-TL351VGMV chính là công nghệ Blue Ag+, sử dụng ánh sáng xanh để kích hoạt tinh thể Ag+ tạo ra các gốc hydroxyl (-OH) để tiêu diệt vi khuẩn. Công nghệ này giúp loại bỏ hoàn toàn các vi khuẩn như E. coli và Staphylococcus aureus (tụ cầu vàng), nguyên nhân gây bệnh đường ruột và kích ứng da.</p><p>Công nghệ Blue Ag+ đã được chứng nhận bởi SüdSachsen Wasser GmbH (Đức) sẽ đảm bảo an toàn tuyệt đối cho người sử dụng. Ngoài việc tiêu diệt vi khuẩn, nó còn giúp bảo quản thực phẩm lâu dài và sạch sẽ.</p><h3>Hạn chế mùi thực phẩm với ngăn trữ đông tinh thể bạc Ag Hygiene Zone </h3><p> NR-TL351VGMV được trang bị ngăn trữ đông Ag Hygiene Zone với tinh thể bạc Ag giúp hạn chế mùi hôi và mùi tanh từ thực phẩm tươi sống như thịt, cá hay hải sản. Ngăn này có thiết kế kéo riêng biệt, dễ dàng tháo lắp để vệ sinh. Chức năng này đặc biệt hữu ích trong việc giữ mùi thực phẩm không bị lẫn vào các ngăn khác trong tủ, đảm bảo sự sạch sẽ và thơm ngon cho các món ăn. Thực phẩm sẽ được bảo quản trong môi trường sạch, tươi mới mà không lo bị nhiễm khuẩn hoặc lẫn mùi.</p><p class="_ilcss0_"><img title="Tủ lạnh có ngăn trữ đông tinh thể bạc Ag Hygiene Zone" src="https://salt.tikicdn.com/cache/w750/ts/product/d9/5e/47/2718e108df4eacae6e659916e0678b43.jpg" alt="Tủ lạnh" width="700" height="391" /></p><h3>Ướp lạnh đồ uống nhanh chóng cùng ngăn Extra Cool Zone </h3><p>Với ngăn Extra Cool Zone của tủ lạnh Panasonic, bạn có thể ướp lạnh đồ uống chỉ trong một khoảng thời gian ngắn. Ngăn này duy trì nhiệt độ lý tưởng khoảng 2 độ C, phù hợp để làm lạnh nhanh các loại đồ uống như nước ngọt, bia, hoặc nước trái cây. Hơn nữa, ngăn Extra Cool Zone được trang bị nắp kháng khuẩn giúp ngăn ngừa sự xâm nhập của vi khuẩn từ bên ngoài, giữ thực phẩm luôn sạch sẽ và bảo vệ sức khỏe gia đình bạn.</p><h3>Tiết kiệm điện với công nghệ Multi Control và cảm biến Econavi </h3><p>Một trong những điểm mạnh của tủ lạnh Panasonic NR-TL351VGMV chính là khả năng tiết kiệm điện năng. Tủ lạnh sử dụng công nghệ cảm biến Econavi, giúp phát hiện mức tiêu thụ điện và tự động tối ưu hóa công suất làm lạnh. Điều này giúp tránh tình trạng lãng phí điện năng khi không cần thiết, đảm bảo hiệu quả tiết kiệm tối đa. Thêm vào đó, công nghệ Multi Control giúp điều chỉnh nhiệt độ ở các ngăn tủ một cách chính xác và ổn định, kết hợp với máy nén Inverter, giúp duy trì hoạt động êm ái, giảm độ ồn và tiết kiệm điện năng cho gia đình.</p><h3>Công nghệ làm lạnh Panorama sẽ làm lạnh đồng đều toàn tủ </h3><p>Với công nghệ làm lạnh Panorama, tủ lạnh Panasonic NR-TL351VGMV sẽ giúp các luồng khí lạnh được thổi đều và nhanh chóng đến mọi ngóc ngách trong tủ, đảm bảo thực phẩm được làm lạnh đều và tươi ngon. Các khí lạnh được lan tỏa theo hình vòng cung, giúp các ngăn tủ luôn duy trì nhiệt độ ổn định và bảo quản thực phẩm trong thời gian dài mà không lo bị hư hỏng.</p><p class="_ilcss0_"><img title="Tủ lạnh Panasonic làm lạnh đồng đều" src="https://salt.tikicdn.com/cache/w750/ts/product/29/22/fe/e26c9da9a9cfc2ab6ac1f36e9ecc38c0.jpg" alt="Tủ lạnh Panasonic" width="700" height="391" /></p><h3>Thiết kế mặt gương tinh tế, sang trọng </h3><p> Panasonic NR-TL351VGMV có thiết kế mặt gương sáng bóng, không viền, tạo nên một vẻ đẹp thanh lịch và hiện đại cho không gian bếp. Mặt gương không chỉ giúp tủ lạnh trông sang trọng mà còn dễ dàng lau chùi, giữ cho tủ luôn sạch sẽ và sáng bóng. Đây là một lựa chọn hoàn hảo cho các gia đình yêu thích sự tối giản và tinh tế.</p><p class="_ilcss0_"><img title="NR-TL351VGMV có mặt gương sang trọng" src="https://salt.tikicdn.com/cache/w750/ts/product/f4/2f/44/dc359433f46b9c1b1a1c2c115c293d82.jpg" alt="NR-TL351VGMV" width="700" height="525" /></p><h3>Lưu trữ rau củ dễ dàng với ngăn rau củ Wide Fresh Case</h3><p>Với ngăn rau củ Wide Fresh Case dung tích 30 lít, tủ lạnh Panasonic giúp bạn dễ dàng lưu trữ rau củ có kích thước lớn như bắp cải, bí ngô, hay cà rốt mà không lo bị chật chội. Ngăn này có khả năng mở rộng tối đa, tạo không gian rộng rãi để bạn có thể cất giữ thực phẩm một cách thoải mái. Bên cạnh đó, ngăn rau củ cũng cung cấp độ ẩm thích hợp, giúp giữ cho rau củ tươi ngon, mọng nước trong thời gian dài.</p><h3>Làm đá siêu tốc tiện lợi khi cần sử dụng  </h3><p>Tủ lạnh 2 cánh Panasonic NR-TL351VGMV còn được trang bị hệ thống làm đá siêu tốc giúp tạo ra các viên đá nhanh hơn 30% so với các dòng tủ lạnh trước đây của Panasonic. Tính năng này rất tiện lợi khi bạn cần sử dụng đá cho các loại đồ uống lạnh, đặc biệt trong những ngày hè nóng bức. Không cần phải chờ đợi lâu, bạn có thể thưởng thức đồ uống mát lạnh ngay lập tức.</p><p class="_ilcss0_"><img title="Panasonic NR-TL351VGMV có khay làm đá siêu tốc" src="https://salt.tikicdn.com/cache/w750/ts/product/05/9e/cf/5937f27a16a52bd9f2818927b7ead413.jpg" alt="Panasonic NR-TL351VGMV" width="700" height="391" /></p><h3>Dung tích phù hợp với gia đình có 3 - 4 người </h3><p>Với dung tích 326 lít, tủ lạnh Panasonic NR-TL351VGMV có đủ không gian để đáp ứng nhu cầu lưu trữ thực phẩm cho gia đình từ 3 đến 4 người. Ngăn lạnh có dung tích 228 lít và ngăn đá 98 lít, mang lại không gian rộng rãi cho các món ăn và thực phẩm đông lạnh. Đây là lựa chọn lý tưởng cho các gia đình nhỏ, vừa đủ để bảo quản thực phẩm cho cả tuần mà không chiếm quá nhiều diện tích trong bếp.</p><p class="_ilcss0_"><img title="Kích thước và dung tích tủ lạnh Inverter" src="https://salt.tikicdn.com/cache/w750/ts/product/b3/a1/e4/0fc827073eba59ab189744de168f1ba2.jpg" alt="Tủ lạnh Inverter" width="700" height="391" /></p><p>Tủ lạnh Panasonic Inverter 326 lít NR-TL351VGMV không chỉ có thiết kế tinh tế, hiện đại mà còn tích hợp nhiều công nghệ tiên tiến như công nghệ khử khuẩn Blue Ag+, công nghệ làm lạnh Panorama và công nghệ tiết kiệm điện Econavi, giúp bảo quản thực phẩm lâu dài, tươi ngon và đảm bảo sức khỏe cho gia đình. Với dung tích hợp lý và tính năng vượt trội, tủ lạnh này là sự lựa chọn hoàn hảo cho các gia đình có từ 3 - 4 thành viên.</p><p><strong>Lưu ý:</strong></p><ul><li>Sau khi nhận tủ lạnh ít nhất từ 2-4 giờ, Quý khách mới được cắm điện để tủ ổn định khí gas và tránh tình trạng sốc điện do cắm điện.</li><li>Hình ảnh sản phẩm chỉ có tính chất minh họa, chi tiết sản phẩm, màu sắc, thiết kế và thông số kỹ thuật có thể thay đổi tùy theo sản phẩm thực tế mà không cần thông báo trước.</li></ul><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278786857, 'Tủ chăm sóc quần áo thông minh LG Styler SC5GMR80H - Hàng Chính Hãng', '<ul><li><strong>Thiết kế mặt gương</strong> sang trọng, thích hợp với nhiều phong cách nội thất.</li><li>Công nghệ <strong>sấy kép (Dual HeatPump)</strong> hiện đại.</li><li><strong>Công nghệ Dual TrueSteam</strong> diệt tác nhân dị ứng.</li><li>Tích hợp bàn ủi công suất cao <strong>Built-in HandySteamer</strong> ủi quần áo dễ dàng và nhanh chóng.</li><li>Hệ thống <strong>AutoFresh System</strong> giữ quần áo luôn thơm tho và khô ráo.</li><li><strong>Moving Hanger</strong> móc treo chuyển động linh hoạt.</li><li>Dễ dàng theo dõi trên ứng dụng <strong>LG ThinQ</strong>.</li><li>Tích hợp <strong>Inverter tiết kiệm điện</strong>, vận hành êm ái.</li></ul><h2>Khám phá tủ chăm sóc quần áo LG Styler SC5GMR80H</h2><h3>Thiết kế hoàn hảo, sang trọng</h3><p>LG Styler SC5GMR80H sở hữu thiết kế vô cùng sang trọng với mặt gương kính đen, tủ thường được lắp đặt ngay bên trong phòng treo quần áo (đối với gia đình có phòng thay đồ và phòng treo quần áo riêng) tạo không gian đẳng cấp cho người dùng.</p><p>Màn hình cảm ứng LCD thông minh với ngôn ngữ Tiếng Việt (mẫu mới 2024) giúp bạn dễ dàng điều khiển trực quan chỉ bằng những thao tác chạm. Bạn cũng có thể kết nối tủ với điện thoại và thông qua ứng dụng ThinQ để điều khiển và giám sát quần áo của mình mọi lúc, mọi nơi và tải xuống các chu trình được thiết kế riêng.</p><p class="_ilcss0_"><img title="Tủ chăm sóc quần áo LG có màn hình Led" src="https://salt.tikicdn.com/cache/w750/ts/product/78/fd/91/2977d655487870f45b8fa608b798f020.jpg" alt="Tủ chăm sóc quần áo LG" width="700" height="402" /></p><h3>Các chức năng chính của tủ chăm sóc quần áo</h3><h4>Là phẳng quần áo bằng hơi nước hiệu quả</h4><p> SC5GMR80H được trang bị tính năng là ly quần âu. Tủ phun ra hơi nước áp suất cao giúp làm giảm nếp nhăn cho quần áo một cách nhanh chóng và dễ dàng.</p><p class="_ilcss0_"><img title="Tủ giặt hấp sấy kèm bàn là hơi LG Styler SC5GMR80H" src="https://salt.tikicdn.com/cache/w750/ts/product/c0/30/39/a8754224f1267aeac0379b353bcace07.jpg" alt="Tủ giặt hấp sấy kèm bàn là hơi LG Styler SC5GMR80H" width="700" height="400" /></p><h4>Tủ có hệ thống thông gió tự động</h4><p>SC5GMR80H có hệ thống thông gió tự động đảm bảo quần áo trong tủ luôn giữ được trạng thái như vừa được chăm sóc mà không cần phải lấy ra ngay. Ngoài ra, tủ còn có cảm biến tự động và thông báo khi quần áo bên trong bị rơi.</p><h4>Sử dụng hơi nước loại bỏ tới 99.99% vi khuẩn </h4><p>LG Styler SC5GMR80H được trang bị tính năng Sanitary Cycle hoạt động bằng hơi nước sẽ loại bỏ tới 99.99% virus, vi khuẩn và có khả năng tiêu diệt rệp, giúp bảo vệ an toàn cho sức khỏe của các thành viên gia đình.</p><p class="_ilcss0_"><img title="SC5GMR80H là bằng hơi nước" src="https://salt.tikicdn.com/ts/product/ac/5e/61/ddbb54fd6ef8e477d9658edd09e60080.jpg" alt="SC5GMR80H" width="700" height="372" /></p><h4>Loại bỏ bụi bẩn, khử mùi, làm khô và giảm nếp nhăn tốt </h4><p>Với chuyển động xoắn và lắc của tủ chăm sóc quần áo không chỉ giúp loại bỏ bụi bẩn, khử mùi, làm khô và giảm nếp nhăn mà còn hỗ trợ các chu trình chuyên biệt như chu trình xử lý bụi mịn, loại bỏ cả hạt lớn và hạt mịn với tốc độ lên tới 350 lần lắc mỗi phút.</p><h4>Khử mùi và tiệt trùng quần áo rất tốt </h4><p>Với bộ gia nhiệt kép, tủ giặt hấp sấy kèm bàn là hơi LG Styler SC5GMR80H cho phép điều chỉnh lượng hơi nước phù hợp với từng mọi loại vải, từ cotton thông thường cho đến các chất liệu nhạy cảm như lụa và cashmere.</p><h4>Làm mới quần áo và giúp ngôi nhà luôn khô thoáng</h4><p>Công nghệ AutoFresh System trong tủ chăm sóc quần áo sẽ điều hòa các dòng không khí một cách tự động, giúp quần áo mềm mại, thơm tho, đồng thời loại bỏ nồm ẩm khỏi không gian với dung tích hút ẩm lên đến 10 lít/ngày.</p><h4>Luôn chủ động với ứng dụng tiện lợi</h4><p>Mỗi khi quần áo rơi khỏi móc treo, bạn sẽ được thông báo qua màn hình LCD hoặc ứng dụng ThinQ.</p><h4>Có hai bộ tạo hơi nước độc lập</h4><p> được trang bị bộ gia nhiệt kép Dual TrueSteam với hai bộ tạo hơi nước độc lập, cho phép tự động điều chỉnh lượng hơi nước một cách tối ưu, phù hợp với từng loại vải, từ cotton thông thường cho đến các chất liệu nhạy cảm như lụa, len cashmere và đồ jeans.</p><p>Ngoài ra tủ sử dụng nồi hấp áp suất cao giúp chăm sóc quần áo một cách nhanh chóng và dễ dàng trước khi bạn ra ngoài. Khi sử dụng bàn là áp suất cao tích hợp, bạn nên đeo găng tay bảo hộ để đảm bảo an toàn. </p><p class="_ilcss0_"><img title="Tủ giặt hấp sấy tích hợp nồi hấp áp suất cao" src="https://salt.tikicdn.com/cache/w750/ts/product/dc/7c/6a/c897db248f51bcb7a395a7e63cad3613.jpg" alt="Tủ giặt hấp sấy kèm bàn là hơi LG" width="700" height="359" /></p><h3 class="_ilcss6_">Cách sử dụng tủ chăm sóc quần áo LG Styler 5 móc</h3><ul><li>Đổ đầy bình chứa nước ở đáy Tủ chăm sóc quần áo.</li><li>Lần sử dụng đầu tiên bạn đổ nước đầy bình ở dưới đáy của tủ chăm sóc quần áo.</li><li>Tháo hộp đựng giấy thơm nằm ở góc dưới bên trái của Tủ chăm sóc quần áo và thêm giấy thơm vào.</li><li>Để quần áo không bị rơi xuống, hãy đảm bảo đóng khóa kéo và các nút sau khi gắn vào mắc treo quần áo.</li><li>Đặt các mắc treo quần áo khít vào các rãnh (mắc treo quần áo di chuyển).</li><li>Nhấn nút nguồn và chọn chương trình bạn muốn.</li><li>Sau khi chọn chương trình bạn mong muốn, hãy nhấn nút Start để khởi động sản phẩm.</li></ul><p>Tủ chăm sóc quần áo hoạt động theo trình tự như sau: chuẩn bị hơi nước → làm nóng trước → làm mới (sử dụng hơi nước + duy trì nhiệt độ) → sấy khô (chuẩn bị sấy khô + sấy khô).</p><p>Mắc treo quần áo di chuyển hoạt động từ ứng dụng hơi nước đến giai đoạn duy trì nhiệt độ của chu trình làm mới với thời gian hoạt động và tốc độ khác nhau đối với mỗi chương trình.</p><p>Mắc treo quần áo di chuyển tương thích với tất cả chương trình, ngoại trừ các chương trình khử trùng và chăm sóc đồ trải giường, trong đó các giá đỡ được sử dụng thay cho mắc treo quần áo di chuyển.</p><p class="_ilcss0_"><img title="Giá treo" src="https://salt.tikicdn.com/cache/w750/ts/product/52/c0/f4/66338fc2a74b9c4183e8746eb2c40e2d.jpg" alt="Tủ chăm sóc quần áo thông minh LG Styler SC5GMR80H" width="700" height="525" /></p><p class="_ilcss0_"><img title="Mắc treo quần áo đi kèm" src="https://salt.tikicdn.com/cache/w750/ts/product/61/ae/f6/cbb2aab52c2841a24de00f34b42d8a7f.jpg" alt="Tủ chăm sóc quần áo thông minh LG Styler SC5GMR80H" width="700" height="525" /></p><h3>Một số câu hỏi thường gặp khi sử dụng tủ chăm sóc quần áo</h3><p><strong>Chương trình hút ẩm phòng là gì?</strong></p><p><strong>Trả lời:</strong> Máy hút ẩm tích hợp giúp quần áo và không gian trong nhà khô ráo nhờ công nghệ AutoFresh System. Bình chứa nước có dung tích 10 lít giúp loại bỏ nỗi lo về sự ẩm ướt. Ngay cả khi cửa đóng, không khí vẫn được lưu thông và hút ẩm để giữ cho tủ quần áo và không gian sống của bạn luôn trong lành và dễ chịu.</p><p><strong>Có thể sử dụng bình chứa nước trong bao lâu sau khi đổ đầy?</strong></p><p><strong>Trả lời:</strong></p><ul><li>Dựa trên chương trình Làm mới, Tủ chăm sóc quần áo có thể được sử dụng 3 đến 4 lần trên một bình nước đầy (hoặc 2 lần đối với chương trình Chuyên sâu).</li><li>Tuy nhiên, trong lần sử dụng đầu tiên, bình chứa đầy sẽ được dùng để làm đầy máy tạo hơi nước bên trong.</li><li>Chỉ cần đổ đầy bình nước khi thông báo đổ đầy nước xuất hiện.</li><li>Bình chứa nước phải được đổ đầy trước khi sử dụng.</li><li>Sử dụng nước lọc sẽ tăng thời gian sử dụng sản phẩm và giúp sản phẩm hoạt động tốt hơn.</li></ul><p><strong>Nên lắp đặt sản phẩm ở đâu và bằng cách nào?</strong></p><p><strong>Trả lời: </strong>Nên lắp đặt sản phẩm trong môi trường có nhiệt độ không dưới 10℃ hoặc vượt quá 35℃. Đảm bảo lắp đặt sản phẩm trong phòng thông gió tốt với khoảng trống phía trên ít nhất 20cm và khoảng cách từ hai bên và phía sau của sản phẩm ít nhất 5cm.</p><p><strong>Lưu ý:</strong> Hình ảnh sản phẩm chỉ có tính chất minh họa, chi tiết sản phẩm, màu sắc, thiết kế và thông số kỹ thuật có thể thay đổi tùy theo sản phẩm thực tế mà không cần thông báo trước.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278786919, 'Mực in HP 981X High Yield Cyan Original PageWide Cartridge (L0R09A) - Hàng chính hãng', '<p>Thông tin nhanh sản phẩm<br />Mã mực: Mực in HP 981X High Yield Cyan Original PageWide Cartridge (L0R09A)<br />Loại mực: In phun màu xanh<br />Dung lượng: 10,000 Trang độ phủ 5%<br />Máy dùng: HP PageWide Enterprise 556dn, 556xh, MFP 586dn, MFP 586f, MFP 586z<br />Bảo hành: Theo date ghi trên hộp mực.</p><p> </p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278786923, 'Mực in HP 981X High Yield Magenta Original PageWide Cartridge (L0R10A) - Hàng chính hãng', '<p>Thông tin nhanh sản phẩm<br />Mã mực: Mực in HP 981X High Yield Magenta Original PageWide Cartridge (L0R10A)<br />Loại mực: In phun màu đỏ<br />Dung lượng: 1,000 Trang độ phủ 5%<br />Máy dùng: HP PageWide Enterprise 556dn, 556xh, MFP 586dn, MFP 586f, MFP 586z<br />Bảo hành: Theo date ghi trên hộp mực</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278786927, 'Mực in HP 981X Yellow High Yield Original PageWide Cartridge (L0R11A) - Hàng chính hãng', '<p>Thông tin nhanh sản phẩm<br />Mã mực: Mực in HP 981X Yellow High Yield Original PageWide Cartridge (L0R11A)<br />Loại mực: In phun màu vàng<br />Dung lượng: 10,000 Trang độ phủ 5%<br />Máy dùng: HP PageWide Enterprise 556dn, 556xh, MFP 586dn, MFP 586f, MFP 586z<br />Bảo hành: Theo date ghi trên hộp mực.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278787030, 'Máy lạnh Casper Inverter 2.5HP GC-24IS35 - Hàng Chính Hãng ', '<p><img title="" src="https://salt.tikicdn.com/ts/tmp/ee/29/ee/1745306a8c003c2f55c547239f19e714.png" alt="" width="642" height="485" /></p><p> </p><h2 class="mb-[32px] pt-5 text-left text-HeadlineLarge font-bold text-dark-400">Thông tin sản phẩm</h2><div class="flex w-full"><div class="w-full"><div><div class="flex flex-col items-start overflow-hidden max-h-full"><div class="main-description break-words"><p>Điều hòa Casper Inverter 21500 BTU GC24IS35 là sản phẩm được nhập khẩu từ Thái Lan. Máy có khả năng làm lạnh cực nhanh khi kích hoạt chế độ Turbo. </p><p>Đồng thời máy cũng được tích hợp công nghệ Inverter giúp tiết kiệm điện hiệu quả. </p><p>Ngoài ra, chiếc điều hòa này cũng được trang bị thêm nhiều tiện ích để nâng cao trải nghiệm người dùng. </p><p>Cùng tìm hiểu thêm những tiện ích nổi bật trên chiếc điều hòa này nhé!</p><p> </p><h2><strong>Đặc điểm nổi bật của Điều hòa Casper Inverter 21500 BTU GC24IS35</strong></h2><p> </p><h3><strong>Thiết kế kiểu dáng hiện đại và lắp đặt dễ dàng </strong></h3><p> </p><h4><strong>Dàn lạnh</strong></h4><p> </p><p>Điều hòa Casper Inverter 21500 BTU GC24IS35 sở hữu một thiết kế liền khối, với gam màu trắng trung tính, hiện đại và phù hợp với nhiều phong cách nội thất khác nhau. </p><p>Các cạnh viền được bo cong nhẹ nhàng, tạo ra sự hài hòa và thu hút ánh nhìn.</p><p>Thiết kế thông minh Easy Care của điều hòa Casper giúp quá trình lắp đặt trở nên đơn giản hơn bao giờ hết. </p><p>Bằng cách tối giản cấu trúc và giảm thiểu việc sử dụng ốc vít, việc lắp đặt trở nên dễ dàng hơn. </p><p>Với công suất làm lạnh mạnh mẽ lên đến 21500 BTU. </p><p>Điều hòa Casper này phù hợp cho các căn phòng có diện tích lớn từ 30 - 40m2 như phòng khách, phòng họp, v.v.</p><p> </p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/32/89/d4/923656c9c9121db84f90476dc984ead9.jpg" alt="171751997929882535643.jpg" /></p><p> </p><h4><strong>Dàn nóng</strong></h4><p> </p><p>Dàn tản nhiệt được làm từ đồng và được phủ một lớp mạ vàng.</p><p>Giúp hạn chế tối đa sự ảnh hưởng của các yếu tố ăn mòn như nước mưa, muối, v.v. </p><p>Đồng thời, chất liệu này cũng tăng cường hiệu suất trao đổi nhiệt và kéo dài tuổi thọ của thiết bị.</p><p> </p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/4a/6b/36/1c21785ae15ee3309ffd837401147932.jpg" alt="1717519982071356535.jpg" /></p><p> </p><h3><strong>Chế độ Turbo: Làm lạnh nhanh chóng</strong></h3><p> </p><p>Chế độ Turbo của Điều hòa Casper Inverter 21500 BTU GC24IS35 mang lại sự tiện lợi khi muốn làm lạnh nhanh chóng toàn bộ căn phòng. </p><p>Chỉ cần một lần nhấn nút trên remote, máy sẽ hoạt động ở công suất cao.</p><p>Giúp giảm nhiệt độ phòng xuống mức mong muốn một cách nhanh chóng. </p><p>Điều này cho phép người dùng thưởng thức không gian mát mẻ và thoải mái ngay lập tức, mà không cần phải chờ đợi lâu.</p><p>Ngoài ra, điều hòa Casper này còn có tính năng tự động điều chỉnh cánh đảo gió lên xuống và trái phải, có thể điều chỉnh bằng tay. </p><p>Giúp hơi lạnh lan tỏa đều khắp phòng một cách nhanh chóng, hạn chế tình trạng thổi trực tiếp vào người dùng.</p><p>Từ đó tạo ra cảm giác mát mẻ và dễ chịu mà không gây ra cảm giác lạnh lẽo hay không thoải mái.</p><p> </p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/49/ac/01/6d6f04dc36215deecbcd5677de648f2f.jpg" alt="17175199916309635504.jpg" /></p><p> </p><h3><strong>Tính năng lọc bụi bảo bảo vệ sức khỏe </strong></h3><p> </p><p>Trong thời đại hiện nay, bụi là một vấn đề phổ biến trong không khí, đặc biệt là ở các đô thị lớn. </p><p>Chính vì vậy Điều hòa Casper GC24IS35 đã được trang bị bộ lọc để loại bỏ những hạt bụi phổ biến. </p><p>Điều này giúp cải thiện chất lượng không khí trong phòng và giảm nguy cơ mắc các vấn đề về sức khỏe đường hô hấp cho người sử dụng.</p><p> </p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/f3/52/c3/1a9708eca7028e76b00f0bd7a4f7d887.jpg" alt="171751999630190103522.jpg" /></p><p> </p><h3><strong>Công nghệ Inverter: Vận hành êm ái và tiết kiệm điện</strong></h3><p> </p><p>Với công nghệ Inverter, điều hòa Casper Inverter 21500 BTU GC24IS35 vận hành một cách êm ái và tiết kiệm điện. </p><p>Công nghệ này cho phép máy điều chỉnh vòng quay của máy nén linh hoạt.</p><p>Giúp máy không phải tiêu tốn năng lượng để tắt/mở liên tục như các động cơ thông thường. </p><p>Ngoài ra, công nghệ Inverter cũng giúp máy nén vận hành ổn định và êm ái, giảm thiểu tiếng ồn tối đa.</p><p>Tạo ra một môi trường sống và làm việc thoải mái và yên tĩnh hơn.</p><p> </p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/cf/65/1e/cea8530fe7fb32ccf58fb69d235be6aa.jpg" alt="171751999942716322560.jpg" /></p><p> </p><h3><strong>Sử dụng gas R32: Làm lạnh sâu, hạn chế ảnh hướng xấu đến môi trường</strong></h3><p> </p><p>Điều hòa Casper Inverter 21500 BTU GC24IS35 sử dụng gas R32.</p><p>Đem lại hiệu suất làm lạnh cao và tiết kiệm năng lượng đáng kể. </p><p>R32, một môi chất làm lạnh thế hệ mới, được ưa chuộng trong nhiều dòng điều hòa hiện đại. </p><p>Nhờ không gây hại cho tầng Ozon và thân thiện với môi trường, đồng thời an toàn cho người sử dụng.</p><p>Điều hòa Casper Inverter đã được chứng nhận với nhãn năng lượng 5 sao và hiệu suất năng lượng CSPF 4.19.</p><p>Giúp người dùng yên tâm về chi phí điện hàng tháng mà vẫn đảm bảo sự thoải mái và tiết kiệm trong sử dụng.</p><p> </p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/c5/13/37/97b9694ef781ea6676eb71d084b62c08.jpg" alt="171752000571927539131.jpg" /></p><p> </p><h3><strong>Cảm biến nhiệt độ phòng tự động</strong></h3><p> </p><p>Trên remote của Điều hòa Casper Inverter 21500 BTU GC24IS35 được trang bị cảm biến nhiệt độ IFeel.</p><p>Giúp thu thập thông tin về nhiệt độ xung quanh remote để điều hòa tự động điều chỉnh nhiệt độ phù hợp.</p><p>Chức năng này đặc biệt hữu ích đối với các gia đình có trẻ nhỏ.</p><p>Vì nó giữ cho nhiệt độ trong phòng luôn ổn định và không chênh lệch quá nhiều so với nhiệt độ cơ thể. </p><p>Điều này giúp người dùng cảm thấy thoải mái và không bị cảm lạnh khi ở trong phòng trong thời gian dài.</p><p> </p><p> </p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/5d/f6/99/e5b1fff8299f0b17961711d9b0b513d4.jpg" alt="171752000926846144760.jpg" /></p><p> </p><h3><strong>I-Clean - Tự động làm sạch dàn lạnh </strong></h3><p> </p><p>Với chế độ I-Clean trên Điều hòa Casper Inverter 21500 BTU GC24IS35, việc làm sạch dàn lạnh trở nên đơn giản và hiệu quả hơn bao giờ hết. </p><p>Chỉ cần kích hoạt chức năng này, máy sẽ tự động thực hiện quy trình làm sạch dàn lạnh theo chuẩn 5 bước.</p><p>Loại bỏ hoàn toàn bụi bẩn tích tụ trong thời gian dài, giữ cho không khí trong phòng luôn sạch sẽ và tươi mới.</p><p> </p><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/2e/15/f3/1353e489e7a17aaab5bdbb421ec55c21.jpg" alt="171752001293911053672.jpg" /></p><p> </p><p><em>Nhìn chung, Điều hòa Casper Inverter 21500 BTU GC24IS35 có khả năng đáp ứng nhu cầu làm mát của nhiều gia đình. Bên cạnh công suất làm lạnh lớn, máy còn được tích hợp nhiều công nghệ hiện đại mang đến sự tiện lợi cho người dùng. Nếu bạn đang quan tâm đến chiếc điều hòa Casper này có thể liên hệ với Điện Máy Pico để được tư vấn cụ thể.</em></p></div></div></div></div></div><p> </p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278787057, 'Mực in HP 981X High Yield Black Original PageWide Cartridge (L0R12A) - Hàng chính hãng', '<p>Thông tin nhanh sản phẩm<br />Mã mực: Mực in HP 981X High Yield Black Original PageWide Cartridge (L0R12A)<br />Loại mực: In phun màu đen<br />Dung lượng: 11,000 Trang độ phủ 5%<br />Máy dùng: HP PageWide Enterprise 556dn, 556xh, MFP 586dn, MFP 586f, MFP 586z<br />Bảo hành: Theo date ghi trên hộp mực.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
