3f80.png" /></p><p>Ngoài khả năng làm lạnh hiệu quả điều hòa Casper còn được tích hợp thêm công nghệ iSaving giúp duy trì nhiệt độ phòng ổn định, tiết kiệm điện năng tối ưu, máy vận hành êm ái, bền bỉ. </p><h3>Khả năng tự động làm sạch dàn lạnh với công nghệ iClean </h3><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/ac/fb/3c/417124452fc61d5d3c5670afda0c2b50.png" alt="acfb3c03f151b23e66f9c00bf1c6a4d4.png" /></p><p>Nhờ công nghệ iClean điều hòa Casper cho khả năng tự động làm sạch dàn lạnh thông minh. Hệ thống làm lạnh sẽ luôn được vệ sinh, đảm bảo sạch bụi bẩn, duy trì khả năng làm lạnh hiệu quả của máy. Chế độ tự làm sạch sẽ được thực hiện trong vòng 20 phút với 5 bước: 1. Đóng băng 2. Rã băng 3. Cuốn trôi 4. Làm nóng sấy khô 5. Quạt tự động khô hơi ẩm.</p><h3>Chế độ Turbo làm lạnh nhanh tức thì </h3><p>Khi bạn kích hoạt chế độ Turbo làm lạnh nhanh tức thì trên remote, điều hòa sẽ hoạt động tạo ra một lưu lượng gió lớn hơn để có thể đạt được nhiệt độ lạnh nhanh hơn trong vòng 3 phút, xua tan đi không khí nóng bức trong căn phòng.</p><h3>Sử dụng Gas R32 thân thiện với môi trường</h3><p><img src="https://salt.tikicdn.com/cache/w750/ts/product/8c/b3/25/e26b48aa530e7494a916cc3719df9325.png" alt="8cb32571304ea5b25cd815577e3b9806.png" /></p><p>Điều hòa Casper 1 chiều Inverter GC- 09IB36/ GC-12IB36  sử dụng môi chất làm lạnh gas R32, môi chất làm lạnh này không chứa chất gây suy giảm tầng Ozon và không tác động nhiều đến tình trạng nóng lên toàn cầu đảm bảo thân thiện với môi trường, cho hiệu suất làm lạnh cao và tiết kiệm điện năng hơn.</p><h3> </h3><p> </p><p> </p><p> </p><p> </p><p> </p></article><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
