  (278795547, 'Cáp HDMI 2.0 4K 60Hz 15M Unitek C11079ABK- HÀNG CHÍNH HÃNG ', '<p class="QN2lPu">Cám ơn khách hàng đã ghé gian hàng của TRƯỜNG THỊNH COMPUTER</p><p class="QN2lPu">Với hơn 15 năm kinh nghiệm trong lĩnh vực cung cấp thiết bị kỹ thuật số, chúng tôi luôn đặt chất lượng sản phẩm và sự hài lòng của khách hàng lên hàng đầu.. Nếu khách hàng muốn hỗ trợ trong vấn đề tư vấn sản phẩm hãy chat ngay với chúng tôi. Chúng tôi rất mong muốn phục vụ quý khách. Trường Thịnh Computer xin cam kết</p><p class="QN2lPu">- 10000% sản phẩm chính hãng , hoá đơn chứng từ đầy đủ</p><p class="QN2lPu">- Chế độ bảo hành , đổi trả minh bạch theo đúng chính sách của nhà sản xuất</p><p class="QN2lPu">- Hỗ trợ khách hàng tận tình trước, trong và sau khi mua hàng.</p><p class="QN2lPu">- Giá cả ưu đãi</p><p class="QN2lPu"> </p><p class="QN2lPu">GIỚI THIỆU MÔ TẢ VỀ SẢN PHẨM</p><p class="QN2lPu">Thông số kỹ thuật</p><p class="QN2lPu">1 x Cáp HDMI 4K</p><p class="QN2lPu"> </p><p class="QN2lPu">Kích thước 88,0mm x 16,8mm x 8,9mm</p><p class="QN2lPu"> </p><p class="QN2lPu">Chiều dài cáp 1M/ 1,5M/ 2M/ 3M/ 5M/ 10M/ 15M/ 20M</p><p class="QN2lPu"> </p><p class="QN2lPu">1-5M: 30AWG với đường kính ngoài 7,3mm</p><p class="QN2lPu"> </p><p class="QN2lPu">10-15M: 26AWG với đường kính ngoài 8mm</p><p class="QN2lPu"> </p><p class="QN2lPu">20M: 24AWG với đường kính ngoài 8,5mm</p><p class="QN2lPu"> </p><p class="QN2lPu">Thông số kỹ thuật HDMI HDMI 2.0</p><p class="QN2lPu"> </p><p class="QN2lPu">Chất liệu/ Màu sắc PVC/ Đen</p><p class="QN2lPu"> </p><p class="QN2lPu">Mô tả sản phẩm</p><p class="QN2lPu">Cáp HDMI 2.0 4K 60Hz 15M Unitek C11079ABK</p><p class="QN2lPu">Chiều dài: 15 Mét</p><p class="QN2lPu">Cáp UNITEK HDMI 2.0 sử dụng dây dẫn đồng từ 30AWG đến 24 AWG để đảm bảo truyền tín hiệu ổn định và đáng tin cậy.</p><p class="QN2lPu">Tính năng sản phẩm</p><p class="QN2lPu">• Video HDR cáp HDMI 4K: UltraHD 4K mang đến cho bạn hình ảnh sắc nét hơn với số điểm ảnh gấp 4 lần so với Full HD tiêu chuẩn (1080p). Dải tương phản động cao (HDR) mang lại màu sắc tươi sáng hơn, chân thực hơn và chi tiết hơn. Từ bộ phim mới nhất đến bộ phim yêu thích của bạn Chương trình truyền hình, mọi hình ảnh trông sống động hơn bao giờ hết. Tương thích ngược với 2K, Full HD 1080p và HD 720p.</p><p class="QN2lPu">• Cáp HDMI 18Gbps tốc độ cao: Tốc độ truyền cao lên tới 18Gbps cho video 4K chân thực ở tốc độ lên tới 60 khung hình/giây và độ sâu màu tối đa 4:4:4. Hỗ trợ HDCP 2.2.</p><p class="QN2lPu">• Âm thanh xung quanh &amp; ARC: Hỗ trợ âm thanh DTS-HD và Dolby mang đến âm thanh vòm sống động cho hệ thống âm thanh tương thích của bạn. Kênh trao đổi âm thanh (ARC) cho phép TV của bạn gửi âm thanh đến hệ thống âm thanh bên ngoài, mang lại trải nghiệm rạp hát tại nhà như rạp phim. Xem bộ phim yêu thích của bạn ở nhà một cách đắm chìm như thể bạn đang ngồi trong rạp chiếu phim.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278795697, 'Cáp chuyển đổi HDMI to DVI Unitek YC 220A - HÀNG CHÍNH HÃNG ', '<p class="QN2lPu"> </p><p class="QN2lPu">Cáp chuyển đổi HDMI to DVI Unitek YC 220A</p><p class="QN2lPu"> </p><p class="QN2lPu">Đánh giá chi tiết về Cáp chuyển đổi HDMI to DVI Unitek YC 220A.</p><p class="QN2lPu">Cáp chuyển đổi HDMI Unitek YC 220A được thiết kế và sản xuất bởi hãng Unitek - là một trong những công ty nổi tiếng về thiết kế, phát triển và sản xuất các sản phẩm dây cáp kết nối HDMI, VGA,.... chất lượng cao.</p><p class="QN2lPu"> </p><p class="QN2lPu">Đặc điểm và tính năng Cáp chuyển đổi HDMI Unitek YC 220A</p><p class="QN2lPu">Cáp chuyển đổi HDMI Unitek YC 220A là sản phẩm cáp chuyển đổi chuẩn DVI 24 +1 và HDMI v.1.4 của hãng Unitek được người dùng tin tưởng và lựa chọn với chất lượng, độ bền cao.</p><p class="QN2lPu">Cáp chuyển đổi HDMI Unitek YC 220A chuyển đổi từ cổng DVI 24 + 1 sang cổng HDMI của Tivi, máy chiếu… Cáp chuyển đổi Unitek YC 220A hỗ trợ truyền cả âm thanh, hình ảnh.</p><p class="QN2lPu"> </p><p class="QN2lPu">Cáp chuyển đổi HDMI Unitek YC 220A cấu tạo chắc chắn giúp tăng tuổi thọ của cáp, phần vỏ nhựa được cáu tạo từ PVC cao cấp, chống oxy hóa chống nhiễu tốt. Đầu cáp được thiết kế chắc chắn với khả năng chống rỉ sét, tối ưu truyền tín hiệu.</p><p class="QN2lPu">Khi sử dụng cáp Unitek YC 220A chỉ cần cắm 2 đầu và thiết bị cần kết nối là có thể chạy mà không cần cài đặt phù hợp với mọi đối tượng sử dụng.</p><p class="QN2lPu">Cáp chuyển đổi HDMI Unitek YC 220A với chiều dài 5m dễ dàng cho người dùng sử dụng mọi lúc. Ngoài ra cáp Unitek YC 220A với cấu tạo mềm mại dễ dàng gấp gọn tiện lợi để trong túi xách, balo đi đi học, đi làm, đi công tác,… cực kỳ thuận tiện</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278795715, 'Cáp chuyển đổi Type-C/USB -> HDMI UNITEK V1167A - HÀNG CHÍNH HÃNG ', '<p class="QN2lPu">Thẻ ghi hình video UNITEK HDMI sang USB-C/A lý tưởng cho việc phát trực tuyến, giảng dạy, hội nghị truyền hình hoặc phát sóng trực tiếp. Sản phẩm hỗ trợ quay video độ nét cao, giúp bạn dễ dàng ghi hình và phát trực tuyến nội dung một cách dễ dàng.</p><p class="QN2lPu"> </p><p class="QN2lPu">TÍNH NĂNG SẢN PHẨM</p><p class="QN2lPu"> </p><p class="QN2lPu">CÁP HDMI L-&gt;USB+TYPE-C 4K VIDEO CAPTURE CARD V1167A</p><p class="QN2lPu"> </p><p class="QN2lPu">Độ phân giải: Hỗ trợ đầu vào 3840x2160@30Hz; đầu ra 1080p@30fps và 720p@60fps.</p><p class="QN2lPu">Giao diện: Tương thích với cả USB và Type-C cho nhiều thiết bị khác nhau.</p><p class="QN2lPu">Xem trước thời gian thực: Ghi lại âm thanh và video cùng lúc.</p><p class="QN2lPu">Dễ sử dụng: Cắm và chạy; không cần trình điều khiển.</p><p class="QN2lPu">Tính di động: Thiết kế nhỏ gọn dễ dàng vận chuyển.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278795827, 'Bộ chia USB Type-C ra 3 cổng USB 3.0 Unitek Y 3095 + Lan Gigabit - HÀNG CHÍNH HÃNG ', '<p class="QN2lPu">Bộ chia USB Type-C ra 3 cổng USB 3.0 Unitek Y-3095 + Lan Gigabit là một USB HUB với thiết kế dạng trong, tỉ mỉ và độc đáo. Cùng với chuẩn giao tiếp tốc độ cao USB3.0 mới nhất, giúp bạn di chuyển dữ liệu của bạn nhanh hơn 10 lần so với USB 2.0 thông thường. </p><p class="QN2lPu">Thông số sản phẩm HUB USB Y-3095 chính hãng UNITEK cao cấp</p><p class="QN2lPu">Nhà sản xuất:      Unitek</p><p class="QN2lPu">Model:                 Y-3095</p><p class="QN2lPu">Chuẩn giao tiếp: USB 3.0, USB Type-C</p><p class="QN2lPu">Băng thông:        5Gbps</p><p class="QN2lPu">Chất liệu:            Nhôm nguyên khối</p><p class="QN2lPu">Số cổng kết nối:+ 3 x USB 3.0</p><p class="QN2lPu">                          + 1 x Gigabit Ethernet Port (RJ45)</p><p class="QN2lPu">Driver:                Đi kèm trong thiết bị</p><p class="QN2lPu">Bảo hành:          12 tháng</p><p class="QN2lPu">Hệ điều hành hỗ trợ: Windows XP / Vista / 7 / 8 / 8.1 / 10, Linux, MacOS,…</p><p class="QN2lPu">Thông tin chi tiết UNITEK Y-3095 HUB USB TYPE-C 3.1 sang 3 USB 3.0 tốc độ cao + 1 Port LAN Gigabit</p><p class="QN2lPu">Thêm vào đó, Bộ chia USB Type-C ra 3 cổng USB 3.0 Unitek Y-3095 và 1 cổng Lan Gigabit  được trang bị thêm một bộ chuyển đổi Gigabit Ethernet, đây là giải pháp tốt nhất cho những dòng máy tính xách tay / Ultrabook mà không có cổng Ethernet (RJ45). Hỗ trợ mạng IPv4 / IPv6, tiết kiệm điện năng và hỗ trợ Wake-On-LAN. </p><p class="QN2lPu">Ngoài ra, Bộ chia USB Type-C Unitek Y-3095 có Driver được tích hợp sẵn trong bộ nhớ của sản phẩm, bạn không cần phải dùng đĩa hoặc download trên mạng.</p><p class="QN2lPu">TÍNH NĂNG, ĐẶC ĐIỂM HUB USB TYPE-C Y-3095 CHÍNH HÃNG UNITEK</p><p class="QN2lPu">– Hub USB hình dạng tròn, thời trang và thanh lịch.</p><p class="QN2lPu">– Chuẩn giao tiếp tốc độ cao USB3.0 SuperSpeed với băng thông  lên đến 5Gbps.</p><p class="QN2lPu">– Tương thích ngược với USB 2.0 / 1.1.</p><p class="QN2lPu">– Hỗ trợ 1 Port Gigabit Ethernet, giải pháp tối ưu nhất cho những máy tính Laptop / Ultrabook mà không có cổng Ethernet (RJ45).</p><p class="QN2lPu">– Hỗ trợ mạng IPv4 / IPv6, tiết kiệm điện năng và hỗ trợ  Wake-On-LAN.</p><p class="QN2lPu">– Tích hợp Driver trong bộ nhớ của sản phẩm.</p><p class="QN2lPu">– Plug and play, hỗ trợ cắm nóng.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
