  (278800520, 'Sạc dành cho Laptop Dell Latitude E7480 hàng nhập khẩu.', '<ul><li>Tên sạc: Sạc dành cho Laptop Dell Latitude E7480</li><li>Công suất: 65W/90W</li><li>Chuẩn chân cắm: 7.4 mm x 5.0 mm Chân Kim</li><li>Điện áp vào(input): 100V - 240V</li><li>Điện áp ra(output) : 19.5V-3.34A/4.62A</li><li>Tần số làm việc: 50 -60 Hz</li><li>Hàng mới 100%, hoàn toàn tương thích với máy</li></ul><p><img src="https://salt.tikicdn.com/ts/tmp/86/34/f6/363d7c768e9ba2d17ef594927e7b463d.jpg" alt="" width="750" height="611" /></p><h4><strong>-  Sạc dành </strong>cho Laptop chất lượng cao đảm bảo các thông số kỹ thuật mà máy tính xách tay của bạn yêu cầu, cấp nguồn ổn định chuẩn dòng cho laptop của bạn làm việc tốt nhất.</h4><p>-  Đặc biệt Tính năng bảo vệ laptop nếu điện áp không chính xác, đoản mạch hoặc quá nóng.</p><p>-  Bộ sạc của chúng tôi là những sản phẩm chất lượng cao với các thông số đạt chuẩn giúp laptop của bạn hoạt động luôn ổn định dù phải làm việc liên tục trong thời gian dài qua đó sẽ kéo dài tuổi thọ chiếc Laptop.</p><p>-  Đặc biệt sử dụng bộ sạc chất lượng cao sẽ giúp Pin laptop lâu chai hơn. </p><p>-  Lưu ý: Cắm sạc vào nguồn điện khoảng 10 giây rồi mới cắm vào laptop (vì dòng điện đi vào sạc nó sẽ ổn định dòng trước khi đi ra, nếu cắm ngược lại thì sẽ bị sốc điện và dẫn đến chết nguồn laptop)</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278800698, 'CÁP TYPE-C -> 4 USB 3.0 + MICRO USB 10W UNITEK H1107A HÀNG CHÍNH HÃNG ', '<p class="QN2lPu">Bảo hành 18 tháng</p><p class="QN2lPu">Vỏ nhôm siêu mỏng</p><p class="QN2lPu">Cổng sạc Micro USB 12W</p><p class="QN2lPu">USB3.1 Gen1 5Gbps SuperSpeed</p><p class="QN2lPu">4 cổng để mở rộng USB</p><p class="QN2lPu">uHUB P5 + là dòng hub 5/6 cổng USB-C gồm 6 mẫu với vỏ nhôm siêu mỏng chỉ rộng 3,5mm. H1107A cung cấp cho bạn 4 cổng USB để mở rộng cộng với sạc 12W qua ổ cắm Micro USB</p><p class="QN2lPu">Thông số kỹ thuật</p><p class="QN2lPu">Màu: Xám không gian</p><p class="QN2lPu">Vật chất: Vỏ hợp kim nhôm</p><p class="QN2lPu">Đầu vào: USB-C Male</p><p class="QN2lPu">Đầu ra: USB-A x4, Micro USB (để sạc 10W)</p><p class="QN2lPu">Kích thước: 110mm x 34,8mm x 12,3mm</p><p class="QN2lPu">Chiều dài cáp: 20,5cm</p><p class="QN2lPu">OD: 4,2mm</p><p class="QN2lPu">Mô tả sản phẩm</p><p class="QN2lPu">4 cổng USB-A để mở rộng dễ dàng. Với thông số kỹ thuật USB3.1 Gen1, tốc độ truyền dữ liệu lên đến 5Gbps. Tương thích ngược với USB2.0 / 1.1.</p><p class="QN2lPu">Với cổng Micro USB cho đầu vào nguồn điện bên ngoài 10W, cung cấp hiệu suất đáng tin cậy để sử dụng các thiết bị tiêu thụ điện cao hơn, ví dụ: Ổ cứng.</p><p class="QN2lPu">Đầu nối USB-C cho phép bạn kết nối với máy tính, máy tính bảng và điện thoại thông minh được trang bị USB-C để đồng bộ hóa dữ liệu (cổng USB-C trên thiết bị của bạn yêu cầu chức năng truyền dữ liệu).</p><p class="QN2lPu">Sạc nhanh với công nghệ BC1.2, cung cấp nguồn điện lên đến 5V1,5A trên mỗi cổng USB-A.</p><p class="QN2lPu">Cắm và chạy, không cần trình điều khiển.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278800705, 'Cáp nối dài USB 10M Unitek Y - 260 có IC khuếch đại HÀNG CHÍNH HÃNG ', '<p class="QN2lPu">CHUYỂN DỮ LIỆU USB 2.0 VỚI TỐC ĐỘ 480Mbps</p><p class="QN2lPu">SỬ DỤNG KẾT NỐI KẾT NỐI ĐƯỢC NHIỀU THIẾT BỊ</p><p class="QN2lPu">TÍCH HỢP IC KHUẾCH ĐẠI TÍN HIỆU , CHỐNG NHIỄU SIÊU TỐT</p><p class="QN2lPu">SỬ DỤNG NGUỒN TRỰC TIẾP TỪ CỔNG KẾT NỐI USB 2.0</p><p class="QN2lPu">CHIỀU DÀI CÁP 10M</p><p class="QN2lPu"> </p><p class="QN2lPu">Cáp USB 2.0 nối dài 10m (Y-260) Cáp USB 10M Y-260 là chuẩn USB 2.0. Là cáp Active USB mở rộng, đảm bảo chất lượng tín hiệu 10m chạy tốt có thể dùng cho camera HD 1080p hoặc nối đài các thiết bị qua cổng USB mà không bị suy hao tín hiệu . Tốc độ truyền dữ liệu lên đến 480Mbps Hỗ trợ Plug and Play, không cần dùng phần mềm cài đặt . Không cần dùng điện ngoài, sử dụng diện qua cổng usb Cáp usb dài 10m Y-260 chân mạ vàng 2 đầu cho tiếp xúc tốt hơn, Dây bọc chống nhiễu hai đầu và bên trong cáp Cáp USB dài 10M Y-206 có thể đi dây trong tường mà không sợ bị hỏng , đầu cáp rất chắc chắn</p><p class="QN2lPu">Bảo hành 18 tháng</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
