  (278800771, 'CÁP TYPE-C -> HDMI 4K + VGA UNITEK V1126A - HÀNG CHÍNH HÃNG ', '<p class="QN2lPu">Tổng quan về sản phẩm:</p><p class="QN2lPu">4K @ 60Hz UHD HDMI</p><p class="QN2lPu">Full HD VGA</p><p class="QN2lPu">Bộ chuyển đổi màn hình này tương thích với các thiết bị USB-C, cung cấp tín hiệu âm thanh / video siêu HD lên đến 4K 60Hz HDMI và tín hiệu video full HD 1080P VGA thậm chí kết nối với hai màn hình bên ngoài qua MST.</p><p class="QN2lPu">Tính năng sản phẩm:</p><p class="QN2lPu">Hỗ trợ HDMI với Ultra-HD (UHD) 4K @ 60Hz.</p><p class="QN2lPu">Hỗ trợ VGA với Full HD 1080p @ 60Hz.</p><p class="QN2lPu">Hỗ trợ Truyền tải đa luồng (MST), để hiển thị tín hiệu video từ PC của bạn đến hai màn hình khác.</p><p class="QN2lPu">Hệ điều hành Windows có thể bật tính năng Screen Mirroring và Extend trên màn hình bên ngoài.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278800828, 'BỘ CHUYỂN USB3.2 TYPE-C RA 4 USB VÀ 1 TYPE C H1117A UNITEK - HÀNG CHÍNH HÃNG ', '<p class="QN2lPu">Giải pháp tuyệt vời để mở rộng cổng USB.</p><p class="QN2lPu"> </p><p class="QN2lPu">Truyền dữ liệu USB3.0 SuperSpeed ​​(5Gbps), tương thích ngược với USB2.0 / 1.1.</p><p class="QN2lPu"> </p><p class="QN2lPu">Với một cổng nguồn tùy chọn (USB-C) lên đến 10W 5V / 2A. Bằng cách kết nối với nguồn điện bên ngoài, có thể cấp nguồn cho các thiết bị ngoại vi.</p><p class="QN2lPu"> </p><p class="QN2lPu">Được thiết kế và sản xuất với công nghệ sạc BC1.2.</p><p class="QN2lPu"> </p><p class="QN2lPu">Plug and play, không cần cài đặt trình điều khiển phức tạp.</p><p class="QN2lPu"> </p><p class="QN2lPu">MÃ:H1117A</p><p class="QN2lPu"> </p><p class="QN2lPu">HÃNG:UNITEK</p><p class="QN2lPu"> </p><p class="QN2lPu">MÀU:ĐEN</p><p class="QN2lPu"> </p><p class="QN2lPu">CỔNG VÀO :USB A 3.2</p><p class="QN2lPu"> </p><p class="QN2lPu">CỔNG RA : 4 CỔNG USB VÀ 1 CỔNG NGUỒN TYPE C</p><p class="QN2lPu"> </p><p class="QN2lPu">CHIỀU DÀI CÁP: 86,8MM x 26MM x 17MM</p><p class="QN2lPu"> </p><p class="QN2lPu">CHẤT LIỆU: VỎ LÀM BẰNG CHẤT LIỆU ABS</p><p class="QN2lPu"> </p><p class="QN2lPu">ĐẦU VÀO: 10W 5V2A</p><p class="QN2lPu"> </p><p class="QN2lPu">GÓI GỒM: 1 HUB Q4 VÀ 1 HƯỚNG DẪN SỬ DỤNG</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278800860, 'Cáp Type-C -> USB (3.0)/HDMI /LAN+Nguồn Unitek (Y9117) hàng chính hãng ', '<p class="QN2lPu">Thương hiệu UNITEK</p><p class="QN2lPu">Model Y9117</p><p class="QN2lPu">Tính năng Type-C -&gt; USB (3.0)/HDMI /LAN</p><p class="QN2lPu">Cổng kết nối cổng vào : Type-C (5Gbps) - &gt; cổng ra : USB 3.0 (5Gbps), HDMI (3840x2160), LAN , cổng cấp nguồn Type-C (Female)</p><p class="QN2lPu">Độ dài 15 cm</p><p class="QN2lPu">Kích thước 98mm x 39mm x 16mm</p><p class="QN2lPu">Với đặc tả USB1.1 GEN1, tốc độ truyền dữ liệu lên đến 5Gbps. Tương thích ngược với USB2.0 / USB1.1.</p><p class="QN2lPu">Gigabit Ethernet cung cấp kết nối internet nhanh và ổn định. Hỗ trợ mạng IPv4 / IPv6, Wake-On-LAN, full duplex và quản lý nguồn điện.</p><p class="QN2lPu">Với cổng HDMI1.4, hỗ trợ độ phân giải 4K. Với một cổng nguồn tùy chọn. Bằng cách kết nối với nguồn điện bên ngoài, nó có thể cấp nguồn cho các thiết bị ngoại vi. Plug and play, không cần phải cài đặt trình điều khiển</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
  (278801021, 'Đầu nối hdmi Unitek A1013BK hàng chính hãng ', '<p class="QN2lPu">Thương hiệu: Unitek</p><p class="QN2lPu">Model: A1013BK</p><p class="QN2lPu">Tính năng sản phẩm</p><p class="QN2lPu">Hỗ trợ 4K HDMI - Tương thích với HDMI 2.0, hỗ trợ 4K@60Hz UHD và HDR.</p><p class="QN2lPu">Khả năng tương thích rộng - Hỗ trợ tín hiệu HDMI từ TV Box, TV Stick, Game Console, PC, Laptop đến HDTV, Màn hình, Máy chiếu, v.v.</p><p class="QN2lPu">Đầu nối bền - Đầu nối mạ vàng để đảm bảo hiệu suất ổn định.</p><p class="QN2lPu">Hỗ trợ đường dài – Hỗ trợ phần mở rộng lên đến 20M cho cáp quang (chỉ đầu vào) và phần mở rộng 10M cho cáp 24AWG (đầu vào/đầu ra).</p><p class="QN2lPu">#daunoihdmi</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
