  (278801868, 'Cáp HDMI 1.4 2m Unitek (Y-C 138M ) hàng chính hãng ', '<p class="QN2lPu">Cable HDMI 2m Unitek Y-C138, Cáp HDMI 1.4 hỗ trợ 1080P 3D X-BOX360, Lõi hợp kim đồng, Vỏ cáp làm từ chất liệu siêu bền, chống nhiễu tốt và mềm dẻo, Tốc độ truyền dẫn cao 10.2 Gbps</p><p class="QN2lPu">- Các tính năng nổi bật của chuẩn HDMI 1.4</p><p class="QN2lPu">1. Tính năng truyền dẫn mạng Ethernet</p><p class="QN2lPu">2. Tính năng Audio Return Chanel. Cái này hay lắm nha, âm thanh chạy qua chạy lại 2 chiều trên 1 sơi cáp HDMI : từ TV đến Receiver và ngược lại. Vây là chỉ với 1 sợi cáp HDMI, vừa dùng để dẫn hình ảnh của phim HD từ cổng HDMI Out của Reiciver lên TV, nhưng lúc coi truyền hình cáp HD trên VTC hay K+, nó lại dẫn ngược âm thanh từ TV chạy xuống Reiceiver ra dàn loa Surround 7.1 hoành tráng luôn (mặc dù đang cắm vào ổng HDMI IN của TV)</p><p class="QN2lPu">3. Hỗ trợ độ phân giải khủng trong tương lai là 4K x 2K : 4096 × 2160 !! Chắc thấy luôn sợi lông trên cọng râu con kiến quá.</p><p class="QN2lPu">4. 3D over HDMI: 3D Bluray, không phải 3D "cấp thấp" Side by Side hay Over by Under đâu nhé, mà là 3D "đích thực", tuyệt đẹp.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>'),
