BEGIN;

-- Categories

ON CONFLICT (id) DO NOTHING;

SELECT setval('categories_id_seq', (SELECT max(id) FROM categories));

-- Attributes

ON CONFLICT (id) DO NOTHING;

SELECT setval('attributes_id_seq', (SELECT max(id) FROM attributes));

-- Products

ON CONFLICT (id) DO NOTHING;

SELECT setval('products_id_seq', (SELECT max(id) FROM products));

-- Options

ON CONFLICT (id) DO NOTHING;

SELECT setval('options_id_seq', (SELECT max(id) FROM options));

-- Attribute Values

ON CONFLICT (id) DO NOTHING;

SELECT setval('attribute_values_id_seq', (SELECT max(id) FROM attribute_values));

-- Products - Attribute Values

ON CONFLICT (product_id, attribute_value_id) DO NOTHING;

-- Product Variants
ON CONFLICT (id) DO NOTHING;

SELECT setval('product_variants_id_seq', (SELECT max(id) FROM product_variants));

-- Option Values
ON CONFLICT (id) DO NOTHING;

SELECT setval('option_values_id_seq', (SELECT max(id) FROM option_values));

-- Product Images

ON CONFLICT (id) DO NOTHING;

SELECT setval('product_images_id_seq', (SELECT max(id) FROM product_images));

-- Product Categories
-- FIXME: This is under product declaration
ON CONFLICT (product_id, category_id) DO NOTHING;

COMMIT;
